INSERT INTO `films` VALUES (3,5,'Мирный воин / Peaceful warrior',1,0,'Дэна Миллмэна, студента колледжа и чемпиона мира по гимнастике, несмотря на успех, преследует чувство, что в его жизни чего-то не хватает. Проснувшись однажды от кошмара, он идет на ночную автозаправочную станцию, встречает старика, которого называет Сократом, и его мир изменяется навсегда. Начинается невероятное обучение у этого эксцентричного старого Воина. Дэн начинает духовную Одиссею в царство света и тени, романтики и тайны, на пути к последнему противостоянию, которое его освободит или уничтожит.\nЭта ставшая классической история, рассказанная с теплотой и юмором, обращена к мирному воину внутри каждого из нас. Совершите путешествие вместе с Дэном по пути мирного воина к безграничному счастью...',1,55,0,1363788879,4310,'7.0','7.92',1402514744,'','',0,2006,1,1,0,0,1363789823),(4,6,'Петля времени / Looper',1,1,'В недалеком будущем, где стали возможны путешествия во времени, некая корпорация убирает нежелательных людей, отправляя их в прошлое в пластиковых пакетах. Задача принимающей стороны — всадить жертве пулю в голову, стерев тем самым несчастного из истории. Все идет гладко до тех пор, пока главный герой не распаковывает очередной пакет, обнаруживая в нем… самого себя из будущего.',1,58,53,1363791076,9045,'7.8','7.2',1402514601,'','',0,2012,1,1,0,0,1363803798),(7,9,'Жизнь Пи / Life of Pi',1,1,'Главный герой фильма оказывается на шлюпке посреди океана в компании неожиданного попутчика — грозного бенгальского тигра.',2,6,56,1363810634,7588,'8.2',' 8.2',1402514675,'','',0,2012,1,1,0,0,1363814623),(8,10,'Питер FM',1,0,'Маша — диджей на популярном питерском радио, Максим — молодой архитектор. Маша готовится к свадьбе с бывшим одноклассником Костей, Максим победил в международном конкурсе архитекторов, и теперь его зовут на работу в Германию. Но оба они не уверены, что им нужно именно это.\n\nМаксима удерживает в Питере любовь к девушке, которая его оставила, а Маша чувствует, что ее жених Костя — совсем не тот человек, который ей нужен. И, кто знает, как бы повернулась их судьба, если бы не Случай — Маша теряет мобильный телефон, а Максим его находит…\n\nТакая история могла произойти только в большом городе, который сталкивает и разводит персонажей на своих улицах. Это лирическая история о двух молодых людях, оказавшихся перед выбором, когда каждый должен решить — что же для него действительно важно?\n\nВозникший между героями «телефонный роман», понимание и тепло, которые они нашли друг в друге, помогают им отыскать верное решение своих проблем. Выбор сделан. И теперь, казалось бы, ничто не мешает Маше и Максиму встретиться…',1,24,0,1363811065,1972,'7.0 ','7.2',1402514854,'','',0,2006,1,1,0,0,1363814623),(9,11,'Дьявол носит Прада / The Devil Wears Prada',1,0,'Мечтающая стать журналисткой провинциальная девушка Андреа по окончании университета получает должность помощницы всесильной Миранды Пристли, деспотичного редактора одного из крупнейших нью-йоркских журналов мод. Андреа всегда мечтала о такой работе, не зная, с каким нервным напряжением это будет связано. Вскоре ей предстоит узнать все ужасы глянцевого мира, а главное — сделать выбор между карьерой и любовью..',1,44,51,1363811497,2400,'6.7','7.5',1402514916,'','',0,2006,2,1,0,0,1363814623),(10,12,'Хроника / Chronicle',1,1,'Три школьника получают супер-способности после обнаружения ими упавшего метеорита. Скоро они попадут в водоворот событий, в котором откроются их темные стороны.',1,29,36,1363812882,8937,'7.1','6.7',1402514912,'','',0,2012,1,1,0,0,1363814623),(11,13,'Мой парень – псих / Silver Linings Playbook',1,1,'Бывший школьный учитель Пэт, проведя в психиатрической больнице восемь месяцев, возвращается в родительский дом. Он одержим мыслью помириться с бывшей супругой, к которой не имеет права приближаться по решению суда. Но знакомство с эксцентричной девушкой Тиффани зажигает в Пэте луч надежды…',1,57,6,1363813182,6838,'8.0','7.4',1402514901,'','',0,2012,2,1,0,0,1363814623),(12,14,'Время / In Time',1,0,'обро пожаловать в мир, где время стало единственной и самой твердой валютой, где люди генетически запрограммированы так, что в 25 лет перестают стареть. Правда, последующие годы стоят денег. И вот богатые становятся практически бессмертными, а бедные, как всегда, обречены сражаться за жизнь.\n\nУилл, бунтарь из гетто, несправедливо обвинен в убийстве с целью грабежа времени и вынужден, захватив заложницу, пуститься в бега. Так, ежеминутно рискуя жизнью, эти двое становятся грозным оружием в борьбе с системой. Но вот вопрос: кто кого? А может быть, в дело вмешается третья сила?..',1,49,16,1363950112,4341,'6.6','7.2',1402481820,'','',0,2011,3,1,0,0,1363950833),(13,15,'В первый раз / The First Time',1,1,'Симпатяга Дэйв безнадежно и бесперспективно влюблен в первую школьную красавицу. Очаровательная Обри встречается с самодовольным мачо, который ей совершенно не подходит, но с которым она, зачем-то, решила лишиться девственности. И совсем неизвестно, как бы обернулись жизни двух этих замечательных молодых людей, если бы они случайно не столкнулись на вечеринке, которую разогнала полиция.\n\nОбри и Дэйв становятся друзьями… нет вы не подумайте — только друзьями, которые могут поплакаться друг другу в жилетку и пожаловаться на превратности любви. Но однажды их нежная дружба начинает под воздействием сильного эротического электричества превращаться во что-то большее — захватывающее и волнующее. В то, что у каждого когда-то бывает в первый раз…и о чем потом, бывает, смешно вспоминать.',1,35,9,1363950488,7124,'6.8','7.0',1402510588,'','',0,2012,2,1,0,0,1363950833),(14,16,'Толстяк на ринге / Here Comes the Boom',1,1,'Учитель биологии в средней школе подрабатывает бойцом в смешанных боевых искусствах, пытаясь собрать деньги, чтобы сохранить школьную музыкальную программу.',1,44,55,1363950771,3414,'6.4','7.0',1402418119,'','',0,2012,1,1,0,0,1363950833),(15,17,'Запах женщины / Scent of a Woman',1,1,'Наступил День благодарения, и отставной полковник разведки Фрэнк Слэйд решает справить праздник, «побаловав» себя поездкой в Нью-Йорк. Фрэнк хочет обставить свой последний «коронный выход» по высшему разряду: изысканный отель, шикарный лимузин, дорогая выпивка и женщины потрясающей красоты.\n\nЕсть лишь две проблемки. Первая: Фрэнк слеп на оба глаза. И вторая: волнующиеся родственники полковника решают нанять за небольшую сумму провожатого в лице нуждающегося студента престижного колледжа по имени Чарли Симмз. Последнее, что было нужно в поездке полковнику Слэйду — так это «зеленый» юнец Чарли. Но случилось так, что путешествие этих двух потрясающе не похожих друг на друга людей изменило их жизни навсегда.',2,36,32,1363991272,1058,'7.8','8.5',1402306302,'','',0,1992,2,1,0,0,1363992881),(16,18,'Слова / The Words',1,0,'Рори Джэнсен — писатель, который наконец обретает долгожданную известность, но его роман-бестселлер оказывается написан другим человеком, которому он теперь должен заплатить высокую цену за украденные у него жизнь и работу.',1,42,41,1363991619,1978,'6.9','7.6',1402405741,'','',0,2012,1,1,0,0,1363992881),(17,19,'Облачный атлас / Cloud Atlas',1,1,'Шесть историй — пять реинкарнаций, происходящих в разное время, тесно переплетаются между собой… Многослойный сюжет начинается с истории американского нотариуса из 19 века, за ним следом идёт бедный музыкант-англичанин из 1930. Далее — издатель гламурных журналов, герой нашего времени. В ближайшем будущем центральным персонажем станет клон-бунтарь, и всё закончится на примитивном человеке на Гавайях, который пережил апокалипсис.',2,52,7,1363992071,2885,'7.8','8.0',1402311384,'','',0,2012,1,1,0,0,1363992881),(18,20,'Три дня на побег / The Next Three Days',1,0,'Жизнь Джона казалась идеальной, пока его красавицу жену не арестовали по подозрению в убийстве. Пока Лара сидит в тюрьме, Джон один воспитывает сына и пытается всеми способами доказать ее невиновность.\n\nНо когда законные способы освободить любимую исчерпаны, единственное, что ему остается — разработать изощренный план побега. Джон готов рискнуть всем ради нее… Но что если она действительно виновна?',2,13,8,1363992645,2791,'7.3','7.7',1402500371,'','',0,2010,1,1,0,0,1363992881),(19,21,'Леон / Leon',1,0,'Профессиональный убийца Леон, не знающий пощады и жалости, знакомится со своей очаровательной соседкой Матильдой, семью которой расстреливают полицейские, замешанные в торговле наркотиками. Благодаря этому знакомству он впервые испытывает чувство любви, но…',1,50,16,1364075838,2005,'8.6','8.8',1402252883,'','',0,1994,2,1,0,0,1364076887),(20,22,'Последний самурай / The Last Samurai',1,0,'Действие разворачивается в Японии 70-ых годов девятнадцатого века. Капитан Нейтон Альгрен, уважаемый американский военный офицер, нанят Императором Японии для обучения первой армии Страны Восходящего Солнца современному искусству ведения боевых действий.\n\nИмператор пытается искоренить древних воинов-самураев, готовясь к более прозападной политике правительства',2,34,0,1364076250,9566,'7.7','8.0',1402489927,'','',0,2003,2,1,0,0,1364076887),(21,23,'1+1 / Неприкасаемые / Intouchables',1,1,'Пострадав в результате несчастного случая, богатый аристократ Филипп нанимает в помощники человека, который менее всего подходит для этой работы, — молодого жителя предместья Дрисса, только что освободившегося из тюрьмы. Несмотря на то, что Филипп прикован к инвалидному креслу, Дриссу удается привнести в размеренную жизнь аристократа дух приключений.',1,52,2,1364076767,3972,'8.6','8.9',1402367164,'','',0,2011,1,1,0,0,1364076887),(22,24,'Начало / Inception',1,0,'Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но они же превратили его в извечного беглеца и лишили всего, что он когда-либо любил.\n\nИ вот у Кобба появляется шанс исправить ошибки. Его последнее дело может вернуть все назад, но для этого ему нужно совершить невозможное — инициацию. Вместо идеальной кражи Кобб и его команда спецов должны будут провернуть обратное. Теперь их задача — не украсть идею, а внедрить ее. Если у них получится, это и станет идеальным преступлением.\n\nНо никакое планирование или мастерство не могут подготовить команду к встрече с опасным противником, который, кажется, предугадывает каждый их ход. Врагом, увидеть которого мог бы лишь Кобб.',2,28,6,1364208558,7404,'8.8','8.8',1402495697,'','',0,2010,2,1,0,0,1364210032),(23,25,'Третий лишний / Ted',1,1,'Джон влюблен в красавицу Лори, у него отличная работа и большие планы на будущее. Но в их отношения вмешивается третий, давний друг Джона — Тед. Он отрывается сутки напролет, предпочитает случайные связи и не желает терять друга. Но никто на самом деле не знает на что он способен, ведь Тед — большой плюшевый медведь.',1,46,3,1364209002,10003,'7.1','7.0',1402384688,'','',0,2012,2,1,0,0,1364210032),(24,26,'Королевство полной луны / Moonrise Kingdom',1,0,'После таинственного исчезновения мальчишки из лагеря бойскаутов принципиальный шериф ставит всех на уши. Свое альтернативное расследование начинает тренер бойскаутов. Мамаша девушки бьется в истерике, а отец, кажется, что-то скрывает… Ведь у каждого в жизни бывает первая любовь.',1,33,37,1364209429,1156,'7.9','7.7',1402395717,'','',0,2012,3,1,0,0,1364210032),(25,27,'Хорошо быть тихоней / The Perks of Being a Wallflower',1,0,'История о Чарли, ученике старшей школы в Питтсбурге, стеснительном и непопулярном. На наших глазах Чарли взрослеет, меняется круг его общения, меняется его мнение о мире.',1,42,40,1364209853,1832,'8.1','7.6',1402062405,'','',0,2012,1,1,0,0,1364210032),(26,28,'Хижина в лесу / The Cabin in the Woods',1,0,'Шумная компания из пяти друзей сбегает на уик-энд подебоширить в изолированную от всего мира деревенскую хижину. Звучит знакомо? Ну так вы и не представляете, что вас ждёт на самом деле.',1,35,0,1364293260,4732,'7.2','6.9',1402475982,'','',0,2012,1,1,0,0,1364295975),(27,29,'Прометей / Prometheus',1,1,'В поисках сакрального знания группа ученых отправляется в самые темные и неизведанные чертоги вселенной. Именно там, в отдаленных мирах, находясь на пределе своих умственных и физических возможностей, им предстоит вступить в безжалостную схватку за будущее всего человечества…',2,3,46,1364293782,4567,'7.2','7.2',1402515464,'','',0,2012,1,1,0,0,1364295975),(28,30,' 7 дней и ночей с Мэрилин / My Week with Marilyn',1,1,'Невероятная, сексуальная и легендарная Мэрилин Монро отправляется в Англию для съемок в новом фильме. Она очаровывает и покоряет всех, включая юного ассистента режиссера Колина. Но что чувствует сама Мэрилин? Может ли она влюбиться в неопытного юношу? И каково это — быть Мэрилин Монро?',1,38,15,1364294514,1468,'7.0','7.1',1402426349,'','',0,2011,1,1,0,0,1364295975),(29,31,'Малышка на миллион / Million Dollar Baby',1,1,'Тренер по боксу Фрэнк Данн переживает не лучшие времена. Из-за сложных отношений со своей дочерью он долгое время не позволял себе привязываться к кому-либо, боясь вновь пережить потерю. Однако все меняется, когда в его тренировочном зале появляется Мэгги. Существуя в постоянной борьбе с окружающим миром, Мэгги выработала в себе непоколебимую стойкость духа и волю к победе. Но больше всего на свете она хочет, чтобы в нее поверили.\n\nФрэнк не хочет брать на себя ответственность, однако упорство Мэгги побеждает. В водовороте жизненных перипетий эти двое осознают, что стремятся к одному и тому же: забыть прошлое и обрести семью. Впереди их ждет главное сражение жизни, для которого им потребуется собрать в своих сердцах столько мужества, сколько раньше они и представить себе не могли…',2,12,31,1364295857,4668,'8.1','8.2',1402508570,'','',0,2004,1,1,0,0,1364295975),(30,32,'Искатели могил / Grave Encounters',1,1,'Участники телевизионного шоу охотников за привидениями «Искатели» во главе с Лэнсом Прэстоном соглашаются провести ночь в психиатрической лечебнице, о которой давно ходят жуткие легенды. Запертые на ночь в большом здании больницы «искатели» быстро обнаружили, что теперь бороться с призраками придется всерьез, а не понарошку, так что дожить до утра у них нет никаких шансов…',1,33,33,1364387544,15884,'6.0','6.2',1402504550,'','',0,2010,3,1,0,0,1364388708),(31,33,'Паралельные миры / Upside down',1,0,'Очень давно две планеты притянулись друг к другу, и на обеих планетах живут люди, для каждой из планет есть своё притяжение. На верхней планете царит богатство и благоденствие. На ней создана корпорация, выкачивающая недры второй планеты и взамен предлагающая электроэнергию по неподъёмной для бедных жителей нижней планеты цене. Перемещение людей между планетами жестко контролируется.\n\nВ центре событий находятся двое людей: она — девушка из богатой семьи из верхнего мира, он — простой человек из нижнего мира, и они любят друг друга. А ещё есть секрет пчелиной пыльцы, которая добывается одновременно на обеих планетах и имеет невероятные свойства',1,47,50,1364387919,3370,'6.3','6.3',1402515163,'','',0,2012,1,1,0,0,1364388708),(32,34,'Старик / Shal',1,1,'Небольшая семья — старик, невестка и внук — ведет обычную и ничем непримечательную жизнь в далекой степи. Им нельзя ссориться, хотя их общение весьма ограничено. Им нужно уметь прощать и быть прозорливыми, чтобы не расплескать по дороге важные истины. Им важно жить по-людски и важно, чтобы старик успел передать своему внуку главные ценности этой жизни.\n\nВеликая степная мораль о необходимости делать добро и не ждать в ответ благодарности, о неспешном и несуетном течении времени без жажды наживы и богатств, о неприхотливости и самодостаточности, о неразрывной связи с легендарным кочевым прошлым нынешних ее наследников…',1,47,50,1364388188,1080,'6.2','7.8',1402184602,'','',0,2012,1,2,0,0,1364388708),(33,35,'Господин никто / Mr. Nobody',1,1,'Проснувшийся немощным стариком Немо Никто оказывается последним смертным в гротескном будущем. Все люди уже давно бессмертны и с удовольствием наблюдают за телешоу, где главная звезда — дряхлый и безумный старик Немо, доживающий свои последние дни. Накануне конца к нему приходит журналист, и Немо рассказывает ему свою историю перескакивая из одной жизни в другую, параллельную, несколько раз за рассказ успев умереть.',2,35,36,1364388587,1104,'7.8','8.0',1402343684,'','',0,2009,1,1,0,0,1364388708),(34,36,'Анна Каренина / Anna Karenina',1,0,'Встречая приехавшую из Петербурга мать, молодой блистательный офицер граф Вронский знакомится с женой влиятельного петербургского чиновника Анной Карениной. Огонь страсти вспыхивает мгновенно, но их любовь шокирует высшее общество. В мире, где правят предрассудки и стереотипы, ей придётся сделать поистине непростой выбор между семьёй и всепоглощающей страстью…',2,9,32,1364479703,2151,'6.7','7.2',1402308363,'','',0,2012,1,1,0,0,1364480657),(35,37,'Бункер / La cara oculta',1,0,'Официантка Фабиана знакомится с одним из случайных посетителей, переживающим сложный период в жизни. Между ними вспыхивает страсть. Для девушки все кажется идеальным: ее любимый работает дирижером оркестра филармонии в Боготе и владеет огромным особняком. Однако вскоре появляются непредвиденные сложности. Полиция расследует таинственное исчезновения бывшей невесты и подруги дирижера, а сама девушка начинает чувствовать, что в доме происходит нечто странное.',1,36,30,1364480163,2185,'7,1','7.4',1402235545,'','',0,2011,1,1,0,0,1364480657),(36,38,'Люди Икс: Первый класс / X-Men: First Class',1,1,'Они были друзьями, они открыли в себе сверхъестественные способности и объединили вокруг себя мутантов, чтобы спасти мир от ядерной войны. Но они оказались по разные стороны баррикад и стали заклятыми врагами. Так началась война между Братством Магнето и подопечными Профессора Икс',2,14,43,1364480451,7838,'7.8','7.7',1402514531,'','',0,2011,1,1,0,0,1364480657),(37,39,'Побег из шоушенка / The Shawshank Redemption',1,0,'Шоушенк — название тюрьмы. И если тебе нет еще 30-ти, а ты получаешь пожизненное, то приготовься к худшему: для тебя выхода из Шоушенка не будет!\n\nАктриса Рита Хэйворт — любимица всей Америки. Энди Дюфрейну она тоже очень нравилась. Рита никогда не слышала о существовании Энди, однако жизнь Дюфрейну, бывшему вице-президенту крупного банка, осужденному за убийство жены и ее любовника, Рита Хэйворт все-таки спасла.',2,22,34,1364570319,1563,'9.2','9.2',1402514543,'','',0,1994,1,1,0,0,1364571085),(38,40,'Семь / Seven',1,0,'Детектив Уильям Сомерсет — ветеран уголовного сыска, мечтающий уйти на пенсию и уехать подальше от города и грешных обитателей. За 7 дней до пенсии на Сомерсета сваливаются две неприятности: молодой напарник Миллс и особо изощренное убийство. Острый ум опытного сыщика сразу определяет, что за этим преступлением, скорее всего, последуют другие. Новости подтверждают его догадку. Поняв, что убийца наказывает свои жертвы за совершенные ими смертные грехи, детектив встает перед выбором: вернуться к работе, либо уйти и передать дело своему менее опытному напарнику?',2,6,49,1364570669,1699,'8.7','8.4',1402514559,'','',0,1995,1,1,0,0,1364571085),(39,41,'Вспомнить всё  / Total Recall',1,1,'Он — обычный рабочий-строитель, живущий в маленькой квартирке в захудалом районе города будущего где-то в Новой Азии. Хотя собственная жизнь его в целом устраивает, он не может избавиться от чувства, что ему хочется чего-то большего. Потребность в новых будоражащих впечатлениях приводит его в офис компании «Вспомнить всё», имплантирующей в память своих клиентов воспоминания-фантазии, которые они могут получить не рискуя при этом пережить сами события в реальности. Пока герой выбирает, какие именно воспоминания ему приобрести, отряд спецназа штурмует комнату, где он находится, и уже было берет его под арест. К своему собственному удивлению, он молниеносно уничтожает весь отряд при помощи невероятных бойцовских навыков, о владении которыми он и не подозревал…',2,10,16,1364571009,132274,'6.3','6.5',1402514571,'','',0,2012,1,1,0,0,1364571085),(40,42,'Ограбление казино / Killing Them Softly',1,0,'Во время подпольной игры в покер совершено ограбление, и угроза повисла над всем воровским сообществом. Воротилы мафии рассчитывают, что Джеки Коган найдет виновных. Однако, вращаясь среди нерешительных заказчиков, жуликов-ростовщиков, усталых убийц и тех, кто спланировал «дело», даже специалисту трудно сохранить контроль над ситуацией…',1,37,13,1364681096,1529,'6.4','6.4',1402514586,'','',0,2012,1,2,0,0,1364681388),(41,43,'Домашняя работа / The Art of Getting By',1,1,'История повествует о парне, который имеет славу разгильдяя и двоечника. У него появляется реальный шанс понравиться девушке своей мечты.',1,23,17,1364681343,2572,'6.4','6.8',1402408798,'','',0,2011,1,1,0,0,1364681388),(47,49,'Монстры на каникулах / Hotel Transylvania',1,1,'Граф Дракула для себя и своей любимой дочки построил хорошо укрытый от посторонних глаз отель, куда монстры со всего света приезжают отдохнуть от семейных забот, повседневной суеты и, конечно… людей. Но вездесущие американские туристы проникают и сюда.',1,31,31,1364890165,8464,'7.0','7.7',1402493113,'','',0,2012,1,1,0,0,1364890628),(48,50,'Хранители снов / Rise of the Guardians',1,1,'Когда злой дух Кромешник посягает на самое дорогое — детские мечты, Северянин, Ледяной Джек, Кролик, Зубная Фея и Песочный Человек впервые объединяются, чтобы создать команду Хранителей снов…',1,37,12,1364890391,7744,'7.3','8.0',1402515420,'','',0,2012,1,1,0,0,1364890628),(49,51,'Три метра над уровнем неба / Tres metros sobre el cielo',1,0,'История двух молодых людей, которые принадлежат к разным мирам. Баби ? богатая девушка, которая отображает доброту и невинность. Аче — мятежный мальчик, импульсивный, бессознательный, склонный к риску и опасности. Это маловероятно, практически невозможно, но их встреча неизбежна, и в этом неистовом путешествии между ними возникает первая большая любовь.',2,2,46,1364964670,9252,'6.6','7.2',1402514467,'','',0,2010,3,1,0,0,1364966034),(43,45,'Хоббит: Нежданное путешествие / The Hobbit: An Unexpected Journey',1,1,'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смауга. Совершенно неожиданно с хоббитом налаживает контакт волшебник Гэндальф Серый. Так Бильбо находит себя, присоединяясь к компании тринадцати гномов, возглавляемых легендарным воином, Торином Дубощитом. Их путешествие проляжет через Дикий Край, через предательские земли, населенные гоблинами и орками, смертоносными варгами и гигантскими пауками, народом, меняющим шкуры, и волшебниками.\n\nИ хотя их цель находится на Востоке среди пустошей Одинокой Горы, сначала им придется выбраться из туннелей гоблинов, где Бильбо встретит существо, которое изменит его жизнь навсегда… Голлума.\n\nЗдесь, один на один с Голлумом, на берегу подземного озера, непритязательный Бильбо Бэггинс обнаружит не только скрытые в глубине души хитрость и отвагу, которые удивят даже его, но и завладеет «прелестным» колечком Голлума, которое обладает нежданными и полезными свойствами… Простое золотое кольцо, c которым связана судьба всего Средиземья, нитями, о которых Бильбо не мог даже вообразить.',2,49,38,1364809760,7926,'8.2','8.5',1402389953,'','',0,2012,1,1,0,0,1364810211),(44,46,'Цель номер один / Zero Dark Thirty',1,1,'История одной из операций спецслужб США по поимке «террориста N1» Усамы Бен Ладена.',2,36,59,1364810051,2063,'7.5','6.8',1402428870,'','',0,2012,1,2,0,0,1364810211),(46,48,'Мой парень - Ангел',1,0,'XXI век. Мегаполис. Сотни, тысячи людей окружают тебя каждый день. Но ты даже и представить себе не можешь, что среди этой многоликой толпы прямо перед тобой может оказаться… Ангел. Студентка Саша с большим трудом верит, что такое бывает. Ангелу Серафиму приходится приложить немало усилий, чтобы доказать ей, что Ангелы существуют. Но он не учёл одного — если девушка тебе поверит, она, скорее всего, тебя полюбит. А разве можно влюбиться в Ангела?',1,37,29,1364889862,4400,'','6.5',1402346620,'','',0,2011,1,1,0,0,1364890628),(50,52,'Невозможное / Lo imposible',1,1,'Лента о событиях, разворачивающихся на фоне цунами 2004 года.',1,53,31,1364965084,2145,'7.6','8.1',1402247553,'','',0,2012,1,1,0,0,1364966034),(240,242,'Астрал: Глава 2 / Insidious: Chapter 2',1,0,'Семья Ламберт стремится раскрыть тайну, из-за которой они оказались в опасной связи с миром духов…',1,50,0,1386927583,8201,'6.9','6.7',1402513567,'','',0,2013,2,1,0,0,1386927915),(241,243,'Гравитация / Gravity',1,1,'Доктор Райан Стоун, блестящий специалист в области медицинского инжиниринга, отправляется в свою первую космическую миссию под командованием ветерана астронавтики Мэтта Ковальски, для которого этот полет — последний перед отставкой. Но во время, казалось бы, рутинной работы за бортом случается катастрофа.\n\nШаттл уничтожен, а Стоун и Ковальски остаются совершенно одни; они находятся в связке друг с другом, и все, что они могут, — это двигаться по орбите в абсолютно черном пространстве без всякой связи с Землей и какой-либо надежды на спасение.',1,30,0,1386935273,7961,'8.4','8.2',1402505118,'','',0,2013,4,1,0,0,1387109915),(52,54,'Шеф / Comme un chef',1,0,'Молодой начинающий повар пытается изменить жизненный устой и предпочтения уже известного «звёздного» шеф-повара, и это упрямство и упорство делает из молодого человека настоящего короля кухни!',1,24,29,1364965930,1381,'6.5','7.1',1402291949,'','',0,2012,3,1,0,0,1364966034),(53,55,'Рождественская история  / A Christmas Carol',1,0,'Это викторианская поучительная история о старом и ожесточившемся скупердяе Эбенезере Скрудже, который в течение одной ночи переживает испытание глубокого очищения. Мистер Скрудж — финансист/денежный меняла, который посвятил всю свою жизнь накоплению богатства. Он презирает всё, кроме денег, включая дружбу, любовь и рождественские праздники.',1,35,48,1365064110,4721,'6.7','7.8',1402514635,'','',0,2009,1,1,0,0,1365066000),(54,56,'Бойцовский клуб / Fight Club',1,0,'Терзаемый хронической бессонницей и отчаянно пытающийся вырваться из мучительно скучной жизни клерк встречает некоего Тайлера Дардена, харизматического торговца мылом с извращенной философией. Тайлер уверен, что самосовершенствование — удел слабых, а саморазрушение — единственное, ради чего стоит жить.\n\nПройдет немного времени, и вот уже главные герои лупят друг друга почем зря на стоянке перед баром, и очищающий мордобой доставляет им высшее блаженство. Приобщая других мужчин к простым радостям физической жестокости, они основывают тайный Бойцовский Клуб, который имеет огромный успех. Но в концовке фильма всех ждет шокирующее открытие, которое может привести к непредсказуемым событиям…',2,19,8,1365065182,4196,'8.7','8.9',1402514632,'','',0,1999,1,1,0,0,1365066000),(55,57,'Джанго освобожденный / Django Unchained',1,1,'Эксцентричный охотник за головами, также известный как «Дантист», промышляет отстрелом самых опасных преступников на Диком Западе. Работенка пыльная, и без надежного помощника ему не обойтись. Но как найти такого и желательно не очень дорогого? Беглый раб по имени Джанго — прекрасная кандидатура. Правда, у нового помощника свои мотивы — кое с чем надо разобраться…',2,45,22,1365159311,5612,'8.6','8.6',1402508096,'','',0,2012,1,1,0,0,1365160152),(56,58,'Хранитель времени / Hugo',1,1,'Когда ловкий и изобретательный Хьюго обнаруживает таинственный механизм, оставленный погибшим отцом, он раскрывает его секрет и отправляется в путешествие, которое изменит тех, кто его окружает, и приведет в безопасное и прекрасное место, которое он назовет своим домом.',2,6,21,1365159651,3285,'7.7','7.1',1402514645,'','',0,2011,3,1,0,0,1365160152),(57,59,'Ледниковый период 4: Континентальный дрейф / Ice Age: Continental Drift',1,1,'После приключений под землей прошло семь лет. Случился дрейф континентов. Главные герои мультфильма, отделённые от стада, вынуждены использовать айсберг в качестве плота. Они пересекают океан и попадают в неизвестные им ранее земли с экзотическими животными и пиратами, враждебно настроенными к ним. Скрэту удаётся получить свой жёлудь, но он перемещается в новые для него земли.',1,27,45,1365160072,12393,'6.6','7.1',1402514670,'','',0,2012,1,1,0,0,1365160152),(58,60,'Как украсть небоскреб / Tower Heist',1,0,'Джошу Ковачу не повезло — его поимел злобный финансист, живущий в роскошных апартаментах на верхнем этаже небоскреба. Чтобы вернуть деньги, Джош с друзьями решается на грандиозную кражу со взломом.\n\nНо одним им это не под силу, и они обращаются к матерому преступнику. Дело за малым — шесть новоявленных друзей Джоушена должны пробраться в пентхаус и отыскать 20 миллионов долларов.',1,44,33,1365235840,2384,'6.2','6.8',1402308433,'','',0,2011,3,1,0,0,1365238299),(242,244,'План побега / Escape Plan',1,1,'Один из самых выдающихся мировых специалистов по системам безопасности соглашается на последнюю рисковую операцию: сбежать из суперсекретной высокотехнологичной тюрьмы, которую называют «Гробницей». Преданный Рэй Бреслин вынужден прибегнуть к помощи напарника — заключенного Эмиля Ротмайера, чтобы разработать отчаянный и практически неосуществимый план побега из самой защищенной тюрьмы в мире!',1,55,0,1387143605,15754,'7.4','7.1',1402504345,'','',0,2013,4,3,0,0,1387144184),(60,62,'Семь психопатов / Seven Psychopaths',1,0,'Непутевый писатель потерял вдохновение и никак не может справиться с новым сценарием. Волей случая он оказывается втянутым в похищение собаки, затеянное его эксцентричными дружками. Выясняется, что украденное животное — любимый пёс главного местного гангстера, которому ничего не стоит в два счета вычислить и уничтожить оболтусов.',1,50,23,1365236430,2055,'7.3','7.5',1402514709,'','',0,2012,1,1,0,0,1365238299),(61,63,'Cirque du Soleil: Сказочный мир в 3D / Cirque du Soleil: Worlds Away',1,1,'Удивительная история двух влюбленных, которых разлучила судьба, по мотивам лучших шоу Cirque du Soleil. Им придется пройти через многое, чтобы снова быть вместе…',1,31,12,1365345579,1425,'6.4','7.6',1402514725,'','',0,2012,3,1,0,0,1365347936),(62,64,'Области тьмы / Limitless',1,0,'Нью-йоркский писатель Эдди, желая преодолеть чёрную полосу в жизни, принимает засекреченный препарат под названием NZT. Таблетка выводит мозг парня на работу в нереальной мощности. Этот творческий наркотик меняет всю жизнь Эдди, за короткий срок он зарабатывает кучу денег, но скоро начинает страдать от зловещих побочных эффектов препарата. А когда пытается найти других NZT-гениев, чтобы понять, как можно справиться с этим пристрастием, он узнает страшную правду…',1,44,46,1365346912,2534,'7.3','8.0',1402504434,'','',0,2011,1,1,0,0,1365347936),(63,65,'Экипаж / Flight',1,1,'Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…',2,18,35,1365347492,1561,'7.3','7.6',1402514739,'','',0,2012,1,1,0,0,1365347936),(64,66,'Схватка / The Grey',1,0,'На Аляске потерпел крушение самолет, и оставшиеся в живых пассажиры оказались в плену безлюдной снежной пустыни, где только стая волков скрашивает пейзаж. Люди хотят выжить любой ценой, и теперь им предстоит смертельная схватка…',1,57,5,1365416114,5424,'6.8','7.1',1402407343,'','',0,2011,1,1,0,0,1365416763),(65,67,'Тор / Thor',1,0,'Эпическое приключение происходит как на нашей планете Земля, так и в вымышленном королевстве богов Асгарде. В центре истории — Могучий Тор, сильный, но высокомерный воин, чьи безрассудные поступки возрождают древнюю войну в Асгарде. Тора отправляют в ссылку на Землю, лишают сил и заставляют жить среди обычных людей в качестве наказания…',1,54,50,1365416443,6672,'7.0','7.0',1402375008,'','',0,2011,1,1,0,0,1365416763),(66,68,'Притворись моей женой / Just Go with It',1,0,'Главный герой Дэнни встретил Палмер, и чтобы произвести впечатление, рассказал о своей несуществующей жене и тяготах семейной жизни. Вместо ожидаемого сочувствия, Палмер хочет познакомиться с его женой, и Дэнни необходимо срочно придумать, как выпутаться из столь интересного положения. К счастью, у него есть знакомая коллега Кэтрин, обаятельная и с детьми, которые и сыграют на время роль его семьи.',1,56,30,1365452075,3200,'6.3','7.3',1402229545,'','',0,2011,1,1,0,0,1365496826),(67,69,'Очень плохая училка /  Bad Teacher',1,0,'Учительница средних классов живет гламурной жизнью светской львицы, ходит на работу как на вечеринку и мечтает об увеличении объема собственного бюста. Однако после внезапного разрыва с богатым бойфрендом ее образ жизни резко меняется, хотя сама она это осознает не сразу. Но когда в их школу приходит новый преподаватель, она совершенно теряет голову и начинает охоту за… деньгами.',1,28,12,1365496122,3984,'5.7','6.4',1402514764,'','',0,2011,1,1,0,0,1365496826),(68,70,'Я – Четвертый / Am Number Four',1,0,'Обычный с виду подросток Джон Смит на самом деле — один из последних выживших обитателей далекой планеты. Джон вынужден скрываться от страшных врагов, посланных уничтожить его. Ему приходится менять имена, постоянно переезжая с места на место со своим опекуном Генри. В разных городках и в разных школах Джон всегда был новичком без прошлого, но однажды он нашел место, которое смог назвать домом: в маленьком городке в Огайо Джон встретил свою любовь. Теперь ему предстоит открыть в себе уникальные способности, сразиться с древними и страшными врагами своего народа и осознать свое удивительное предназначение.',1,49,34,1365496409,3829,'6.1','6.5',1402391221,'','',0,2011,3,1,0,0,1365496826),(69,71,'Патруль / End of Watch',1,0,'Лос-Анджелес. На первый взгляд это самый обычный город, живущий своей жизнью. А вот если копнуть глубже, туда, где обитают преступные группировки и криминальные общины, понимаешь, как сложна работа тамошних полицейских. О таких бравых ребятах, служащих закону и заботящихся о порядке на улицах города, и пойдет речь. Перед нами двое неразлучных товарищей-копов. Эти ребята дорожат своей дружбой и готовы подставить друг другу плечо помощи в любую минуту. Нечасто случается, чтобы напарники были лучшими друзьями. Героям сопутствует успех в делах, они настоящие профессионалы в своем нелегком деле. И надо же было такому случится, что во время патрулирования одного из самых преступных районов Лос-Анджелеса они попадают в водоворот страшных криминальных событий…',1,48,32,1365587083,3089,'7.7','7.7',1402514786,'','',0,2012,1,1,0,0,1365587944),(70,72,'Аватар / Avatar',1,1,'Джейк Салли — бывший морской пехотинец, прикованный к инвалидному креслу. Несмотря на немощное тело, Джейк в душе по-прежнему остается воином. Он получает задание совершить путешествие в несколько световых лет к базе землян на планете Пандора, где корпорации добывают редкий минерал, имеющий огромное значение для выхода Земли из энергетического кризиса.',2,41,41,1365587495,9723,'8.0','8.0',1402514797,'','',0,2009,1,1,0,0,1365587944),(71,73,'ДухLess',1,0,'Главный герой фильма — 29-летний топ-менеджер крупного международного банка по имени Макс. Он уверен, что жизнь удалась, ведь у него есть то, о чём многие не могут даже и мечтать: дорогая машина, пентхаус и вечеринки. Свою жизнь Максим тратит на зарабатывание денег, а деньги — на ночные клубы, шикарных девушек, кокаин и прочие атрибуты, так называемой, гламурной жизни. Но в какой-то момент к герою приходит осознание того, что с его жизнью что-то не так. И его мир начинает рушиться, подобно карточному домику. В картине говорится о переоценке себя и жизни вокруг, о преодолении внутреннего кризиса.',1,41,11,1365587775,1623,'6.3','6.7',1402308489,'','',0,2011,2,1,0,0,1365587944),(72,74,'Хичкок / Hitchcock',1,0,'Известный режиссер отваживается на эксперимент: отойти от ставших его визитной карточкой дорогостоящих фильмов в жанре «саспенс» и снять скромную, к тому же черно-белую картину «Психо». В процессе работы будущий «мастер страха» вглядывается в темные бездны человеческой души, чтобы найти те нервные окончания, прикасаясь к которым он мог бы, как по клавишам, сыграть на эмоциях зрителя настоящую симфонию ужаса.',1,38,21,1365667040,785,'7.0','7.5',1402480039,'','',0,2012,1,1,0,0,1365672595),(73,75,'Шаг вперед 4 / Step Up Revolution',1,0,'Эмили, дочь влиятельного бизнесмена, приезжает в Майами с намерением стать профессиональной танцовщицей, но влюбляется в Шона — юношу, чья танцевальная труппа устраивает музыкальные флэшмобы. Команда, называющаяся MOB, участвует в конкурсе с внушительным денежным призом, а тем временем отец Эмили намеревается перестроить родной район ребят и переселить тысячи людей. Эмили присоединяется к танцорам и организует протестные мобы, рискуя не осуществить мечту, но сражаясь за нечто более важное.',1,38,39,1365667671,6537,'6.2','7.2',1402305998,'','',0,2012,1,1,0,0,1365672595),(74,76,'Пол: секретный материальчик / Paul',1,1,'Два английских гика отправляются на одно из самых значимых фанатских событий в области фантастики — конвент ComicCon в Америке. По пути, неподалёку от известной Зоны 51, они встречают сбежавшего инопланетянина по имени Пол, который просит помочь ему добраться домой. Пытаясь спастись от правительственных агентов, герои случайно похищают женщину и натыкаются на обкуренную свидетельницу аварийной посадки Пола на Землю.',1,43,40,1365668008,6234,'7.0','7.3',1402406244,'','',0,2011,2,1,0,0,1365672595),(75,77,'Отступники / The Departed',1,0,'Два лучших выпускника полицейской академии оказались по разные стороны баррикады: один из них — агент мафии в рядах правоохранительных органов, другой — «крот», внедрённый в мафию. Каждый считает своим долгом обнаружить и уничтожить противника, но постоянная жизнь в искажённых реалиях меняет внутренний мир героев.',2,31,19,1365774676,4203,'8.5','8.5',1402294539,'','',0,2006,1,1,0,0,1365774881),(76,78,'Люди в чёрном 3 / Men in Black 3',1,1,'Агент Джей узнает, что никакого защитного галактического щита, способного отразить иноземный удар, не существует. Агент Кей не построил его, потому что был убит в 1969 году. Агент Джей должен совершить путешествие во времени, чтобы спасти Землю и жизнь напарника.',1,45,50,1365869477,8503,'6.9','7.5',1402514815,'','',0,2012,1,1,0,0,1365869832),(80,82,'Шрек 2 / Shrek 2',1,0,'Шрэк и Фиона возвращаются после медового месяца и находят письмо от родителей Фионы с приглашением на ужин. Однако те не подозревают, что их дочь тоже стала огром! Вместе с Осликом счастливая пара отправляется в путешествие, полное неожиданностей, и попадает в круговорот событий, во время которых приобретает множество друзей…',2,57,4,1366296205,2330,'7.3','7.7',1402514850,'','',0,2004,1,1,0,0,1366296527),(77,79,'Властелин колец: Две крепости / The Lord of the Rings: The Two Towers',1,1,'Братство распалось, но Кольцо Всевластья должно быть уничтожено. Фродо и Сэм вынуждены доверить свои жизни Голлуму, который взялся провести их к вратам Мордора. Громадная Армия Сарумана приближается: члены братства и их союзники готовы принять бой. Битва за Средиземье продолжается.',3,55,30,1366184747,4728,'8.7','8.5',1402376556,'','',0,2002,1,1,0,0,1366186526),(78,80,'Ледниковый период 3: Эра динозавров / Ice Age: Dawn of the Dinosaurs ',1,1,'К событиям «Ледникового периода 3» жизнь главных героев мультфильма потерпела некоторые изменения. Мамонты Манфред и Элли ожидают появление на свет своего детёныша; саблезубый тигр Диего впал в раздумье о том, не стал ли он слишком «мягкотелым» в компании своих друзей; ленивец Сид, бредя желанием создать собственное племя, решился украсть несколько яиц динозавра. Отправившись спасать Сида, друзья попадают в таинственный растительный мир, скрытый под толщами льда, где они сталкиваются с динозаврами и агрессивной окружающей средой, а также знакомятся с охотником на динозавров — лаской по имени Бак.\n\nКрысобелка Скрэт (который вновь случайным образом стал виной глобальной проблемы, открыв путь в мир динозавров) по-прежнему гоняется за своим орехом, но на этот раз у него появился конкурент — крысобелка Скрэтти, однако, одновременно с одержимой борьбой за орех, эти двое влюбляются друг в друга.',1,34,3,1366185975,4748,'7.0','7.7',1402301444,'','',0,2009,1,1,0,0,1366186526),(79,81,'Шрек / Shrek',1,0,'Жил да был в сказочном государстве большой зеленый великан по имени Шрек. Жил он в гордом одиночестве в лесу, на болоте, которое считал своим. Но однажды злобный коротышка — лорд Фаркуад, правитель волшебного королевства, безжалостно согнал на Шреково болото всех сказочных обитателей.\n\nИ беспечной жизни зеленого великана пришел конец. Но лорд Фаркуад пообещал вернуть Шреку болото, если великан добудет ему прекрасную принцессу Фиону, которая томится в неприступной башне, охраняемой огнедышащим драконом…',1,30,4,1366295830,2957,'7.9','8.1',1402514837,'','',0,2001,1,1,0,0,1366296527),(81,83,'Шрэк Третий / Shrek the Third',1,0,'Королем может быть не каждый — особенно если вы не очень симпатичный великан. Когда Шрэк женился на принцессе Фионе, он меньше всего на свете хотел управлять Далекой-Далекой страной. Такой он невластолюбивый. Однако отец Фионы, король Гарольд, внезапно умирает, и корону должен унаследовать именно Шрэк. Как-никак, он все-таки муж наследницы.\n\nОднако Шрэк наотрез отказывается от бремени власти, и решает отправиться вместе со своими старыми друзьями Ослом и Котом в сапогах на поиски кандидата на трон. Если Шрэк не найдет себе подходящей замены, ему придется управлять сказочной страной самому… и это надолго. Похоже, что король Артур — тот, кто им нужен.\n\nОднако в отсутствие великана его старый враг принц по имени Чарминг замышляет всякие пакости, для чего и возвращается в сказочную страну. Шрэку придется очень постараться, чтобы спасти страну от происков врагов и от возможного переворота.',1,32,47,1366296449,3532,'6.0','6.7',1402346856,'','',0,2007,1,1,0,0,1366296527),(82,84,'Счастливчик / The Lucky One',1,0,'Морской пехотинец Логан Тибо сумел остаться в живых после трех военных миссий в Ираке. Своим талисманом он считает фото, которое всегда носит с собой — на нем совершенно незнакомая ему женщина. По возвращении в Северную Каролину Тибо решает разыскать ее.',1,41,0,1366874830,4404,'6.9','6.2',1402389886,'','',0,2012,1,1,0,0,1366875385),(83,85,'Возвращение героя / The Last Stand',1,1,'Самая опасная и жестокая банда наркоторговцев сбегает из-под конвоя ФБР. Прихватив заложника, они мчатся к мексиканской границе на бронированной, оснащенной первоклассным вооружением машине. У них на пути стоит лишь тихий городок, за порядком в котором следит шериф Оуенс. Когда-то он был одним из лучших полицейских Лос-Анджелеса, теперь он вернулся.',1,47,0,1366875150,10659,'6.7','6.9',1402482011,'','',0,2013,1,1,0,0,1366875385),(84,86,'Феи: Тайна зимнего леса / Secret of the Wings',1,0,'Динь-Динь и ее подруги всегда боялись пересекать границу с Зимним лесом, ведь существует поверье, что там очень опасно. В один прекрасный день Динь-Динь, сгорая от любопытства, подходит вплотную к лесу, и ее крылья неожиданно начинают блестеть и переливаться. Завороженная Динь, желая узнать тайну волшебных крыльев, кутается в теплое пальто и отправляется в глубь таинственного леса, где ее ждет неожиданное открытие…',1,15,4,1367148869,4266,'6.7','7.4',1402502869,'','',0,2012,1,1,0,0,1367150519),(85,87,'Охота / Jagten',1,0,'После мучительного развода 40-летний Лукас находит новую подругу, новую работу и стремится восстановить отношения со своим сыном-подростком Маркусом. Но ему что-то мешает… Что-то, казалось бы, незначительное. Замечание, сделанное между прочим. Мелкая ложь. И вот накануне Рождества, когда падает снег и зажигаются огни на елке, ложь разрастается и проникает повсюду, как невидимый вирус. Растет недоверие, и все вокруг оказываются в состоянии коллективной истерии. Лукас вынужден бороться за свою жизнь и достоинство.',1,55,28,1367149552,1073,'8.3','8.1',1402482045,'','',0,2013,1,1,0,0,1367150519),(86,88,'Боб Марли / Marley',1,1,'Свежий взгляд на Боба Марли, его жизнь и глобальное влияние заложенной им культуры.',2,25,6,1367149973,1449,'7.8','8.1',1402514870,'','',0,2012,1,1,0,0,1367150519),(87,89,'Ральф / Wreck-It Ralph',1,1,'Ральф — второстепенный персонаж восьмибитной компьютерной игры, и ему надоело находиться в тени главного героя, мастера на все руки Феликса, который всегда появляется, чтобы «исправить» ситуацию! После тридцати лет добросовестной работы в роли злодея, в течение которых все похвалы выпадали на долю Феликса, Ральф больше не хочет быть плохим.\n\nОн решает отправиться в путешествие по аркадным играм разных жанров, чтобы доказать всем, что и он тоже может быть героем. На своем пути Ральф встречает героев разных игр — хладнокровную сержанта Калхун из игры Hero’s Duty, оберегающую планету от нашествия инопланетных захватчиков, и сладкую на вид, но острую на язычок Сластену фон Дю, чье существование в гоночном симуляторе Sugar Rush внезапно оказывается под угрозой. Наконец-то Ральфу выпадает шанс показать, что он умеет не только разрушать!',1,41,13,1367231386,5435,'7.9','8.0',1402514885,'','',0,2012,2,1,0,0,1367242271),(88,90,'История игрушек / Toy Story',1,1,'Каждый ребенок верит, что когда он оставляет свои игрушки одни, они начинают заниматься своими делами. Этот мультипликационный фильм позволяет убедиться им в своей правоте.\n\nОсновная идея фильма — каждая игрушка боится надоесть, стать забытой, замененной другой, так как весь смысл их существования — доставлять счастье своим хозяевам.',1,21,27,1367231742,3403,'8.3','7.9',1402514897,'','',0,1995,1,1,0,0,1367242271),(89,91,'Охотники на гангстеров / Gangster Squad',1,1,'Лос-Анджелес, 1949 год. Уроженец Бруклина, жестокий главарь банды Микки Коэн держит город в ежовых рукавицах, собирая «грязные» деньги от торговли наркотиками, оружием и проституции, и — если все пойдет, как надо, — к Западу от Чикаго мышь не пискнет без его ведома. Защищают его не только его же головорезы, но и находящиеся у него «на крючке» полиция и политики. Этого хватит, чтобы запугать даже самых смелых, закаленных улицей копов… кроме, пожалуй, небольшой тайной группы сотрудников полицейского департамента Лос-Анджелеса во главе с сержантом Джоном О’Мара и Джерри Вутерсом, которые объединились, чтобы попытаться уничтожить преступный мир Коэна.',1,52,54,1367232057,6227,'6.8','7.2',1402482058,'','',0,2013,1,1,0,0,1367242271),(90,92,'Сломленные / Broken',1,1,'Девчонке по кличке Сканк (Вонючка) — 11 лет. У неё диабет. Она — классная. Только начались летние каникулы, и дни её полны лёгких надежд. Но противный дядька из дома напротив, избивает Рика, доброго, но очень ранимого соседского паренька, поскольку его дочь обвиняет Рика в изнасиловании. Мир вокруг стремительно рушится; Сканк ищет утешения в тихой дружбе с Риком, но запутывается окончательно.',1,27,0,1367653331,1668,'7.2','7.8',1402219911,'','',0,2012,1,1,0,0,1367654066),(91,93,'В поисках немо',1,1,'Среди прекрасных тропических морских стихий, в районе Большого барьерного рифа в уединении живет рыба-клоун по имени Марлин. Он растит своего единственного сыночка Немо. Океан и существующие в нем опасности очень страшат Марлина, и он как может ограждает сына от них, но молодой Немо, страдающий излишним любопытством, очень хочет разузнать побольше о таинственном рифе, рядом с которым они живут.\n\nКогда Немо по иронии судьбы оказывается вдалеке от дома, да и еще сталкивается с угрозой стать обедом рыбы-танка, Марлин отправляется на поиски сына. Но Марлин, конечно же, понимает, что героический спасатель из него не получится и просит о помощи в поисках, Дори, королевскую синюю рыбу, которая хоть и страдает от того, что почти ничего не помнит, но добрее ее не отыскать во всем безбрежном океане!\n\nИтак, наши герои отправляются в путешествие, в котором их подкарауливают многочисленные трудности и опасности…',1,32,0,1367653681,3637,'8.1','7.9',1402485563,'','',0,2003,1,1,0,0,1367654066),(92,94,'Король говорит / The King\'s Speech',1,1,'Сюжет ленты расскажет о герцоге, который готовится вступить в должность британского короля Георга VI, отца нынешней королевы Елизаветы II. После того, как его брат отрекается от престола, герой неохотно соглашается на трон. Измученный страшным нервным заиканием и сомнениями в своих способностях руководить страной, Георг обращается за помощью к неортодоксальному логопеду по имени Лайонел Лог.',1,58,0,1367827537,1262,'8,1','8.2',1402411002,'','',0,2010,1,1,0,0,1367828047),(93,95,'Операция «Арго» / Argo',1,1,'4 ноября 1979 г. революция в Иране достигает своего апогея, исламисты штурмуют посольство США в Тегеране и берут в заложники 52 американца. Но в этом хаосе шестерым удается ускользнуть и найти прибежище в доме канадского посла. Понимая, что их обнаружение и, вероятнее всего, убийство — всего лишь вопрос времени, Тони Мендес, специалист ЦРУ по тайному вывозу людей из страны, предлагает рискованный план безопасной эвакуации. План столь невероятен, что такое бывает только в кино.',2,0,0,1367827955,3244,'7.9','7.8',1402507962,'','',0,2013,1,1,0,0,1367828047),(94,96,'Город Бога / Cidade de Deus',1,0,'60-е годы XX века. «Город Бога» — квартал в Рио-де-Жанейро, где живут главные герои — 8-летний Ракета, мечтающий стать фотографом, и его одногодок Дадинью. Дадинью принимает участие в вооруженном ограблении, организованном живущим по соседству гангстером Кабалейрой; с согласия Кабалейры он совершает свое первое убийство.\n\n70-е годы. Ракета постоянно балансирует между мелкими правонарушениями и честной жизнью. На счету у Дадинью уже несколько убийств. Он возглавляет банду, которой управляет, используя хитрость и хладнокровное предательство. Поняв, что настоящая власть и большие деньги может дать только контроль над торговлей наркотиками в их квартале, он безжалостно идет к своей цели.\n\n80-е годы. Ракета наконец получает фотоаппарат и осуществляет свою детскую мечту. Мечта Дадинью тоже сбылась: в 18 лет он стал самым крутым торговцем наркотиками в Рио.\n\nВместе со своей армией юных хулиганов Дадинью безраздельно правит в квартале до тех пор, пока Мане Галинья не поклялся отомстить ему за то, что тот изнасиловал его подружку, и не решил убить его, чего бы это ни стоило. В фавеле начинается война…\n',2,4,24,1367994885,1981,'8.7','8.2',1402414395,'','',0,2002,1,1,0,0,1367995928),(95,97,'Вверх / Up',1,1,'78-летний ворчун Карл Фредриксен считает, что жизнь обходит его стороной. Чтобы сдержать обещание, данное своей почившей жене, он решает осуществить свою мечту о великом приключении, привязав тысячи воздушных шариков к своему дому и улетев в дебри Южной Америки. Не пролетев и полмили, путешественник обнаруживает, что он ненароком прихватил с собой крайне разговорчивого и неисправимо жизнерадостного 8-летнего мальчика по имени Рассел…',1,36,37,1367995234,2646,'8.3','8.1',1402394873,'','',0,2009,1,1,0,0,1367995928),(96,98,'Ультиматум Борна / The Bourne Ultimatum',1,1,'Он хотел одного — исчезнуть. Вместо этого за Борном теперь охотятся люди, которые сделали его таким, какой он есть. Он потерял память и человека, которого он любил. Но его не удается сдержать даже новому поколению профессиональных убийц. У него только одна цель: вернуться к началу и узнать кем он был, Джейсон Борн.\n\nОн мечется от Москвы к Парижу, через Мадрид и Лондон в Танжер и Нью-Йорк, пытаясь раскрыть последние загадки своего прошлого, в то время, как правительственные агенты и Интерпол пытаются помешать ему восстановить всю картину до конца.',1,55,14,1367995531,4229,'8.1','7.9',1402433920,'','',0,2007,1,1,0,0,1367995928),(97,99,'Социальная сеть / Social Network',1,1,'В фильме рассказывается история создания одной из самых популярных в Интернете социальных сетей — Facebook. Оглушительный успех этой сети среди пользователей по всему миру навсегда изменил жизнь студентов-однокурсников гарвардского университета, которые основали ее в 2004 году и за несколько лет стали самыми молодыми мультимиллионерами в США.',2,0,27,1368086532,3280,'7.9','7.9',1402482081,'','',0,2010,1,1,0,0,1368087266),(98,100,'Рестлер / The Wrestler',1,1,'Главный герой фильма — Рэнди «Баран» Робинсон — был звездой 80-х, но стал бледной копией самого себя. Получив инфаркт во время одного из матчей, борец услышал от врачей неприятную весть: если он продолжит выступления, то может умереть. Пытаясь начать жизнь заново, Рэнди устроился работать в магазин и налаживал отношения с дочерью. Но уж больно заманчивой была перспектива матча-реванша со старым соперником по кличке Аятолла…',1,49,10,1368086920,3094,'8.0','7.6',1402411756,'','',0,2008,1,1,0,0,1368087266),(99,101,'Идеальный голос / Pitch Perfect',1,1,'Картина основывается на книге Мики Рэпкина «Пой идеально: Погоня за славой вокалиста а капелла», в которой рассказывается о студентке, внезапно обнаружившей в себе страсть к пению а капелла, то есть, без музыкального сопровождения.\n',1,52,7,1368696844,3970,'7.2','7.1',1402482093,'','',0,2013,1,1,0,0,1368698047),(100,102,'Линкольн / Lincoln',1,1,'Биографическая лента об Аврааме Линкольне, шестнадцатом президенте США, который внес неоценимый вклад в победу северян во времена гражданской войны.',2,29,57,1368697437,2566,'7.6','7.2',1402493851,'','',0,2012,1,1,0,0,1368698047),(101,103,'8 первых свиданий',1,1,'Вера — телезвезда, ее жених Константин — профессиональный теннисист. Они собираются пожениться. Никита врач-ветеринар и красавица-хирург Илона также спешат оформить отношения. Но одно прекрасное утро разрушает все планы. После веселого вечера Вера просыпается в одной постели с Никитой. Решив, что это последствия слишком бурной вечеринки, молодые люди разъезжаются в разные стороны. Но следующим днем все повторяется — Никита и Вера снова вместе, хотя каждый хорошо помнит, как они засыпали дома — каждый у себя… Так происходит всю последующую неделю. Какие-то таинственные силы устраивают эти неожиданные «свидания», кто-то хочет разрушить их браки, а может быть просто доказать, что они созданы друг для друга?',1,26,33,1368799745,4606,'5.9','6.2',1402491054,'','',0,2012,1,1,0,0,1368800611),(102,104,'Даю год / I Give It a Year',1,0,'Фильм в комедийном ключе поведает о всевозможных проблемах и трудностях, с которыми приходится сталкиваться молодоженам в первый год их семейной жизни.',1,37,25,1368800027,2723,'6.0','6.1',1402435825,'','',0,2012,1,1,0,0,1368800611),(103,105,'Паркер / Parker',1,1,'Главный герой — профессиональный вор, руководствующийся собственным моральным кодексом, но способный запросто отправить на тот свет любого, кто перейдет ему дорогу.',1,58,40,1368958051,9792,'6.1','6.6',1402482113,'','',0,2013,1,1,0,0,1368958582),(104,106,'21 и больше / 21 & Over',1,1,'Двое друзей подбивают третьего отметить его 21-ый день рождения прямо накануне важного экзамена в медицинский колледж. Никто не замечает, как одна кружка пива превращается в море выпивки, а вечеринка — в бурное и незабываемое приключение с музыкой и девчонками. И где же они окажутся утром?',1,29,19,1368958297,4843,'5.6','6.3',1402482126,'','',0,2013,1,1,0,0,1368958582),(105,107,'Легенда №17 ',1,1,'2 сентября 1972 года. Монреаль. Хоккейная сборная СССР с разгромным счетом 7:3 победила канадских профессионалов из НХЛ в стартовом матче эпохальной Суперсерии СССР-Канада. Это была не просто игра, это была битва за свою страну, которая перевернула мировое представление о хоккее.\n\nТеперь весь мир знал его просто по номеру «17». Валерий Харламов, забивший в том матче 2 шайбы, мгновенно взлетел на вершину славы. Сбылась его мечта -упорство, спортивный талант и суровые уроки великого тренера Анатолия Тарасова сделали из «номера 17» легенду мирового хоккея.',2,4,10,1369062209,10398,'7.3','8.6',1402510647,'','',0,2013,4,1,0,0,1369065651),(106,108,'Охотники на ведьм / Hansel & Gretel: Witch Hunters',1,1,'Едва не погибнув в лапах ужасной ведьмы, Гензель и Гретель стали только сильнее. Одержимые местью, они ведут отчаянную борьбу со злом, даже не подозревая, что их поджидает нечто куда более опасное… собственное прошлое…\n',1,27,57,1369064176,22156,'6.1','6.7',1402486928,'','',0,2013,2,1,0,0,1369065651),(107,109,'Гостья / The Host',1,1,'Земля — в опасности! Наше место скоро займут Души — лишенные плотской оболочки пришельцы, вытесняющие из человеческих тел разум и замещающие его разумом собственным. Большая часть человечества уже погибла. Немногие выжившие скрываются в жалкой попытке отсрочить неизбежное… Теперь Душа пытается захватить тело юной Мелани. Однако происходит неожиданное: Мелани и ее Душа вынуждены сосуществовать в одном теле. Гостье надлежало выследить и выдать землян-повстанцев, с которыми связана Мелани, но она помогает своей носительнице.',2,10,28,1369208832,6248,'5.8','6.3',1402486305,'','',0,2013,1,1,0,0,1369209392),(108,110,'Впусти меня / L?t den r?tte komma in',1,0,'Двенадцатилетний Оскар живет в небольшой деревушке неподалеку от Стокгольма. Днем он подвергается насмешкам и терпеливо сносит унизительные пинки и затрещины от одноклассников, зато потом Оскар мечтает о мести.\n\nОднажды ночью Оскар знакомится с девочкой по имени Эли. Она его новая соседка. Два изгоя мгновенно становятся друзьями, Эли учит Оскара храбрости, а Оскар пробуждает в ней жажду любви. Но Эли, увы, этого недостаточно — ее мучает жажда крови.',1,54,52,1369209092,18339,'8.0','7.1',1402495728,'','',0,2008,1,1,0,0,1369209392),(110,112,'Кон-Тики / Kon-Tiki',1,0,'Приключенческая картина, в основе которой лежит подвиг всемирно известного путешественника Тура Хейердала, совершившего в 1947 году эпическую экспедицию — пересечение Тихого океана на маленьком шатком плотике Кон-Тики. Гигантские киты, схватки с голодными акулами, грозовой шторм, раздирающий ветер, битва за жизнь посреди бушующей стихии…. Героям предстоит проявить немалую силу и трудолюбие, чтобы этот день не стал последним. Это невероятное путешествие навсегда изменит людей, которые рискнули в него отправиться.\n',1,49,11,1369389916,2152,'7.2','7.5',1402482174,'','',0,2013,2,1,0,0,1369390571),(111,113,'Как приручить дракона / How to Train Your Dragon',1,0,'Вы узнаете историю подростка Иккинга, которому не слишком близки традиции его героического племени, много лет ведущего войну с драконами. Мир Иккинга переворачивается с ног на голову, когда он неожиданно встречает дракона Беззубика, который поможет ему и другим викингам увидеть привычный мир с совершенно другой стороны…',1,37,51,1369390450,5208,'8.2','8.4',1402484921,'','',0,2010,2,1,0,0,1369390571),(112,114,'Побочный эффект / Side Effects',1,0,'Жизнь главной героини Эмили пошла под откос, когда её мужа посадили в тюрьму. Вначале она пыталась спастись от депрессии своими силами, горстями глотая успокоительное. После того, как стало понятно, что это не поможет, Эмили не оставалось другого выхода кроме отправления в психиатрическую лечебницу к добрым и заботливым людям в белых халатах.\n\nТеперь главная героиня борется со своими внутренними демонами уже не одна — справиться с угнетённым состоянием ей помогают два лучших доктора клиники, а также экспериментальные препараты, обладающие довольно странными побочными эффектами. Не получится ли так, что все внутренние страхи Эмили вместо того, чтобы исчезнуть, вырвутся наружу?',1,46,22,1369493949,1690,'7.2','7.3',1402511290,'','',0,2013,1,1,0,0,1369646456),(113,115,'Назад в будущее / Back to the Future Part',1,0,'Подросток Марти с помощью машины времени, сооруженной его другом профессором доком Брауном, попадает из 80-х в далекие 50-е. Там он встречается со своими будущими родителями, еще подростками, и другом-профессором, совсем молодым.',1,56,1,1369643758,2033,'8.5','8.5',1402342720,'','',0,1985,1,1,0,0,1369646456),(114,116,'Назад в будущее 2 / Back to the Future Part II',1,0,'Продолжение фантастической истории о приключениях американского подростка во времени. На этот раз с помощью модернизированной Доком машины времени Марти из 80-х попадает в будущее.\n\nДети Марти в беде, и их надо выручать. Приходится повозиться со злодеем…',1,47,59,1369644391,1797,'7.3','8.3',1402380371,'','',0,1989,1,1,0,0,1369646456),(115,117,'Назад в будещее 3 / Back to the Future Part III',1,0,'Из газет 1955 года Марти узнает, что доктор Браун погиб еще сто лет назад. Несмотря на просьбы Дока не навещать его в XIX веке, Марти вновь хочет вмешаться в ход событий и на машине времени уносится в 1885 год, навстречу Дикому Западу.\n\nЭто путешествие, как и все прежние, не обходится без опасных приключений, но смелый Марти, рискуя жизнью, предотвращает трагедию в жизни Эммета Брауна. Тот, в свою очередь, без памяти влюбляется в очаровательную незнакомку, которую спасает от гибели, и поездка домой — в будущее — теряет для него всякий смысл…',1,58,13,1369644551,2035,'7.3','8.1',1402483760,'','',0,1990,1,1,0,0,1369646456),(116,118,'Таймлесс. Рубиновая книга / Rubinrot',1,1,'Живущая в Лондоне шестнадцатилетняя Гвендолин Шеферд случайно узнает, что обладает уникальным геном путешественника во времени, который унаследовала от прапрабабушки. Теперь девушка может ежедневно переноситься в прошлое, и с каждым днем загадок становится все больше. Что такое «Тайна Двенадцати»? Кто охотится на путешественников во времени в прошлом? И почему все вокруг думают, что она обладает какой-то «магией ворона»?',2,1,13,1369645479,7665,'6.0','6.3',1402312606,'','',0,2013,1,1,0,0,1369646456),(117,119,'Оз: Великий и Ужасный / Oz the Great and Powerful',1,1,'Когда ураган забрасывает циркового фокусника Оскара Диггса из пыльного Канзаса в волшебную страну Оз, склонный к мошенничеству циркач полагает, что он поймал удачу за хвост — ведь с помощью своих трюков он с легкостью может добыть в новых землях и славу и богатство.\n\nОднако его ждёт встреча с тремя чародейками, Теодорой, Эванорой и Глиндой, которые сомневаются в том, тот ли это великий волшебник, появления которого ждали легковерные жители страны Оз. Волей-неволей, пришелец оказывается втянутым в противостояние эпического масштаба, и ему приходится использовать весь свой «магический» арсенал, с добавлением толики настоящего волшебства.\n\nВ ситуации выбора между Добром и Злом, Оскару Диггсу предстоит не только стать Великим и Ужасным Волшебником из Страны Оз, но и немного измениться к лучшему.',2,10,22,1369734754,5644,'6.7','6.6',1402482187,'','',0,2013,1,1,0,0,1369737263),(118,120,'Время ведьм / Season of the Witch',1,0,'XIV столетие. В Европе свирепствует чума. Виновницей смертоносной беды признают беззащитную девушку, подозревая ее в колдовстве. Умирающий кардинал просит рыцаря Бэймена доставить ведьму в далекое аббатство, где ее чары должны быть разрушены.\n\nШестеро верховых и повозка с железной клеткой, в которой заточена обвиняемая, отправляются в опасное путешествие. Скоро рыцари осознают, их миловидная спутница действительно не человек, а исчадие ада.',1,34,54,1369735304,6560,'6.1','5.3',1402487811,'','',0,2010,1,1,0,0,1369737263),(119,121,'Новый Человек-паук / The Amazing Spider-Man',1,1,'В детстве Питер Паркер был оставлен своими родителями, и поэтому воспитывался дядей и тётей. Шли годы, Питер был обычным примерным школьником, подвергался нападкам хулиганов и был влюблён в свою одноклассницу Гвен Стэйси, которая сама втайне отвечала ему взаимностью. Но после укуса генетически изменённого паука, Питер получает невероятные сверхспособности и его жизнь меняется навсегда.\n\nОднако его не перестаёт мучить вопрос о том, что случилось с его родителями. Он знакомится с давним другом и партнёром своего отца — генетиком Куртом Коннорсом, который вместе с отцом Питера разрабатывал формулу регенерации. Питер помогает её закончить, а Коннорс, всю жизнь мечтавший восстановить свою правую руку, вводит формулу себе и становится Ящером. Осознавая свою вину, Питер начинает новую жизнь в образе таинственного супергероя Человека-паука и становится грозой преступников, одновременно пытаясь найти способ остановить Коннорса.',2,16,17,1369828542,14840,'7.2','7.2',1402491080,'','',0,2012,3,1,0,0,1369829116),(120,122,'Пророк / Next',1,0,'У Криса Джонсона есть секрет, отравляющий его жизнь: он может предсказывать ближайшее будущее. Устав от бесконечного внимания правительства и медицинских центров, пытающихся разгадать природу его удивительных способностей, Крис ложится на дно.\n\nПод вымышленным именем он работает в Лас-Вегасе, где развлекает публику дешевыми фокусами. Но когда группа террористов угрожает Лос-Анджелесу, специальному агенту Калли Феррис придется собрать все силы, чтобы разыскать Криса и убедить его помочь предотвратить катастрофу.',1,36,10,1369828898,3903,'6.1','7.2',1402482205,'','',0,2007,2,1,0,0,1369829116),(121,123,'Мемуары гейши / Memoirs of a Geisha',1,0,'Маленькую прелестную девочку из бедной японской семьи отдают в услужение в дом гейш. С годами красавица расцветает и познает все таинства этой профессии. Самые влиятельные мужчины становятся пленниками знаменитой гейши по имени Сайюри, достигшей совершенства в своем искусстве.\n\nНо в сердце Сайюри теплится любовь к тому, над которым ее чары не властны. Тайну своей любовной страсти она доверяет лишь страницам дневника…',2,25,8,1369902246,4587,'8.0','7.2',1402486323,'','',0,2005,1,1,0,0,1369903127),(122,124,'Неудержимый / Bullet to the Head',1,1,'Киллер из Нового Орлеана объединяется с молодым полицейским из Нью-Йорка, расследуя дело, которое выводит их с мрачных задворок Нового Орлеана в светлые коридоры правительственных зданий в Вашингтоне. Необычный дуэт формируется в результате двух жестоких убийств. Герои убирают всех, кто стоит у них на пути, и готовы пожертвовать всем, чтобы отомстить.',1,31,13,1369902655,6444,'6.0','6.2',1402510515,'','',0,2012,1,1,0,0,1369903127),(123,125,'Стукач / Snitch',1,1,'Ради спасения сына, которому грозит срок за продажу наркотиков, отец идет на сделку с полицией. Он должен внедриться в самое сердце наркомафии.',1,51,12,1369973098,11909,'6.6','7.0',1402421757,'','',0,2013,3,1,0,0,1370072142),(124,126,'Рок-н-рольщик / RocknRolla',1,0,'Фильм окунет вас в опасный мир коррупции и жизни криминальных отбросов современного Лондона, где недвижимость потеснила такого внушительного лидера торгового рынка, как наркотики, а самыми активными предпринимателями стали преступные группировки. Но каждому, кто захочет проворачивать там свои дела, будь то мелкая сошка Раз-два или русский теневой миллиардер Юрий Омович, придется сначала договориться с одним и тем же человеком — Ленни Коулом.',1,54,19,1370071411,2705,'7.3','7.7',1402461797,'','',0,2008,1,1,0,0,1370072142),(125,127,'Джек – покоритель великанов / Jack the Giant Slayer',1,1,'История начинается с похищения принцессы, что грозит нарушить хрупкий мир между людьми и великанами. Юный фермер возглавляет вылазку в царство гигантов в надежде спасти девушку.',1,54,20,1370072021,11085,'6.6','6.7',1402251514,'','',0,2013,3,3,0,0,1370072142),(126,128,'Метро',1,1,'Широко развернувшееся в центре Москвы строительство новых зданий приводит к тому, что в одном из тоннелей метро между двумя станциями возникает трещина. Никто себе и представить не мог, что в результате нарушения герметичности перекрытия в тоннель хлынет вода из Москва-реки, и сотни пассажиров поезда окажутся во власти надвигающегося потопа. Бешеный поток воды грозит не только обрушением тоннелей метро, но и разрушением всего города.\n\nСреди попавших в беду людей — врач городской больницы Андрей Гарин и его дочь Ксюша. Гарин сражается с катастрофой, пытаясь спасти оставшихся в живых пассажиров, в том числе и …любовника своей жены. Гарину придется побороть обиду, гнев и страх. Он должен выжить, чтобы вернуть свою любовь, семью… свою прежнюю счастливую жизнь.',2,11,45,1370169012,4817,'6.7','7.4',1402257164,'','',0,2012,1,1,0,0,1370169963),(127,129,'Побег с планеты Земля / Escape from Planet Earth',1,0,'На планете Бааб, в самом центре Вселенной, два брата делают всё возможное, чтобы защитить свою галактику. Они — полные противоположности. Если девиз Гарри — «сначала подумай, потом сделай», то отважный Скорч живет по закону «сила есть — ума не надо», что не мешает им слаженно работать. Но однажды они получают сигнал S.O.S. с опасной планеты…под названием Земля. Скорч, сломя голову, бросается на помощь, и, разумеется, влипает в неприятности. Только Гарри может вытащить его из «Зоны 51». Братья откроют множество головокружительных тайн, но смогут ли они сбежать с самой опасной планеты во Вселенной?',1,29,16,1370169627,5198,'5.4','6.3',1402460707,'','',0,2013,1,1,0,0,1370169963),(128,130,'Мадагаскар 3 / Madagascar 3: Europe\'s Most Wanted',1,1,'Лев Алекс, зебра Марти, гиппопотамиха Глория и жираф Мелман, а также король Джулиан, Морис, Морт и Пингвины все еще пытаются вернуться в Нью-Йорк. На этот раз их путь пройдет через Европу, где они откроют свой цирк.',1,33,24,1370273819,12192,'6.9','7.3',1402514240,'','',0,2013,1,1,0,0,1370360235),(129,131,'Джек Ричер / Jack Reacher',1,0,'Снайпер убивает нескольких случайных прохожих. Его находят и арестовывают. Все улики указывают на него. На допросе вместо признания он пишет имя — Джек Ричер. Больше обвиняемый не может ничего сказать, поскольку после избиения заключёнными впадает в кому. Загадочный Джек Ричер появляется незамедлительно. Что теперь будет с убийцей?',2,10,24,1370359878,11665,'7.3','7.0',1402330763,'','',0,2013,1,1,0,0,1370360235),(130,132,'Дублер',1,0,'Главный герой нашей истории — успешный актер, звезда шоу-бизнеса Игорь Успенский. Его жизнь — сплошные съемки, концерты, презентации, корпоративы, интервью и светские тусовки. Он вынужден «крутиться» день и ночь, у него нет выходных и праздников. А его очаровательная жена и прекрасная дочка видят его в лучшем случае поздно ночью, когда он приезжает домой, чтобы поспать хотя бы пару часов. Но все труды не проходят даром. Игорь очень популярен и однажды его кандидатуру выдвигают на премию «Человек года» — теперь ему нужно еще больше времени, чтобы победить главного конкурента — певца Михаила Стасова, главные хиты которого свели с ума всех женщин России…\n',1,23,34,1370949687,2158,'5.7','5.1',1402502666,'','',0,2012,1,1,0,0,1370950527),(131,133,'Тревожный вызов / The Call',1,0,'Фильм расскажет про оператора колл-центра 911, куда поступает звонок от девочки-подростка, ставшей жертвой маньяка. Героине предстоит столкнуться со своими кошмарами, чтобы спасти девушку.',1,30,6,1370950289,2362,'7.2','6.6',1402503115,'','',0,2013,1,1,0,0,1370950527),(132,134,'Орда ',1,0,'Орда. Веками это слово означало кровавые набеги и унизительную дань для многих стран и народов. Странный и страшный мир со своими законами и обычаями. В середине XIV века власть Орды простирается над большей частью Евразии. Платит дань восточному соседу и Московское княжество. Когда ханшу Тайдулу сражает тяжелый недуг, ни один целитель оказывается не в силах ей помочь. Тогда в Орду вызывают «московского колдуна» митрополита Алексия. На карту поставлена судьба всего княжества. Однако и сам Алексий не знает, чем обернется его путешествие в Орду.',2,9,26,1371123776,4179,'6.3','6.1',1402483955,'','',0,2012,1,1,0,0,1371124385),(133,135,'Полетта',1,1,'Полетт — вредная старушка с непростым характером. Она ненавидит соседей, поскольку те мусорят и шумят. Она не любит своего внука и придумала ему прозвище Черныш, поскольку дочь вышла замуж за чернокожего полицейского (зятя Полетт называет Обамой).\n\nКогда социальные службы начинают за долги описывать ее имущество, она принимает нестандартное решение: отправляется к местному наркодилеру и предлагает свои услуги. Бандиты ошеломлены, но бабушка находит убедительные доводы, чтобы ее приняли на работу. Не проходит и месяца, как Полетт становится крупнейшим торговцем всех видов наркотиков в районе. Бизнес процветает, жизнь налаживается. Однако любопытные подруги, зять, любвеобильный сосед и бандиты не дают насладиться ей обретенным благосостоянием.',1,26,49,1371124214,1554,'6.1','7.4',1402502552,'','',0,2012,1,1,0,0,1371124385),(134,136,'Хватай и беги',1,1,'Бывший грабитель банков Чарли, когда-то пошедший на сделку с правосудием, скрывается в маленьком калифорнийском городке: у него свой дом, налаженный быт и любимая девушка Энни. Когда Энни узнает, что у нее есть шанс получить работу мечты в Лос-Анджелесе, она уговаривает Чарли нарушить правила, высунуть нос из городка и отвезти ее на собеседование.\n\nПрограмма по защите свидетелей дает сбой, и на след Чарли выходят его бывшие подельники, во главе с мстительным психопатом Алексом. К погоне также присоединяются неуравновешенный федеральный маршал, приставленный для охраны Чарли, и ревнивый бывший парень Энни. Вместо увеселительной прогулки Чарли ждет непрекращающаяся череда столкновений, ловушек и подстав — не говоря уже о встречах с колоритными жителями Южной Калифорнии, которые вносят дополнительные нотки сумасшествия в и без того безумную гонку.',1,39,51,1371620005,5837,'6.0','5.6',1402405450,'','',0,2012,1,1,0,0,1371620457),(135,137,'Шутки в сторону / De l\'autre c?t? du p?riph',1,0,'Усман, дерзкий коп из парижского пригорода, и Франсуа, амбициозный столичный полицейский, объединяют усилия в расследовании убийства жены большого чиновника. Усман и Франсуа — разные. Усман живет по законам комедий с Эдди Мерфи, Франсуа обожает Бельмондо в «Профессионале» и «Смертельное оружие». Но расхождение в киновкусах — ничто, когда на кону громкое разоблачение коррупции в самых верхах и, конечно, дружба! Один плюс один = команда, а шутки — в сторону!',1,34,44,1371620393,3446,'5.9','6.3',1402437963,'','',0,2012,1,1,0,0,1371620457),(136,138,'Человек из стали / Man of Steel',1,1,'Кларк Кент/Кал-Эл — молодой человек, который чувствует себя чужаком из-за своей невероятной силы. Много лет назад он был отправлен на Землю с развитой планеты Криптон, и теперь задается вопросом: зачем?\n\nВоспитанный приемными родителями Мартой и Джонатаном Кентами, Кларк знает: обладать сверхспособностями — значит принимать сложные решения. Но когда человечество более всего нуждается в стабильности, оно подвергается нападению. Сможет ли герой восстановить мир, или воспользуется своей силой для того, чтобы окончательно его разрушить?',2,12,3,1372104885,39455,'8.1','7.6',1402506624,'','',0,2013,2,1,0,0,1372105945),(137,139,'Университет монстров / Monsters University',1,1,'Майк и Салли — самые опытные пугатели в Монстрополисе, но так было далеко не всегда. Когда они встретились впервые, эти монстры терпеть друг друга не могли. «Университет Монстров» — история о том, как наши старые знакомые прошли путь от взаимной неприязни к крепкой дружбе.',1,34,25,1372272370,10807,'7.8','8.0',1402486385,'','',0,2013,5,3,0,0,1372273278),(138,140,'Форсаж 6 / Furious 6',1,1,'После того как Доминик и Брайн побывали в Рио, где они ограбили и свергли империю вора в законе, их команда получила 100 миллионов, и наши герои оказались разбросаны по всему миру. Но их привычка вечно жить в бегах не даёт им покоя. Между тем, Хоббс отслеживал организацию смертельно опасных наёмников-водителей по двенадцати странам. Единственный способ остановить эту криминальную группу — это превзойти их на улицах, поэтому Хоббс просит Доминика собрать его элитную команду в Лондоне. За это он обещает полное помилование для Доминика и его друзей, чтобы они смогли наконец вернуться домой к своей семье.',2,2,20,1372273110,51818,'7.6','7.2',1402514074,'','',0,2013,3,1,0,0,1372273278),(139,141,'Иллюзия обмана / Now You See Me',1,1,'Команда лучших иллюзионистов мира проворачивает дерзкие ограбления прямо во время своих шоу, играя в кошки-мышки с агентами ФБР.',1,45,34,1372407782,7282,'7.5','8.0',1402306437,'','',0,2013,5,3,0,0,1372442001),(140,142,'Падение олимпа / Olympus has fallen',1,1,'Когда на Белый Дом нападают террористы, а президента берут в заложники, дискредитированный бывший охранник главы государства Майк Бэннинг оказывается внутри захваченного здания. И теперь он единственный, кто сможет спасти президента…',1,59,9,1372441846,6680,'6.6','6.9',1402502403,'','',0,2013,1,1,0,0,1372442001),(141,143,'Семейка крудз / The Croods',1,1,'Землетрясение уничтожило дом доисторической семьи, и теперь Крудсам придётся искать другое пристанище. А вокруг новый и опасный мир! Им на помощь приходит молодой кочевник Малой, передовые взгляды которого наталкиваются на консервативность главы семьи Груга. ',1,29,28,1372505709,9127,'7.5','8.0',1402412725,'','',0,2013,5,3,0,0,1372507095),(142,144,'Эффект колибри / Hummingbird',1,0,'Бывший спецназовец Джоуи Джонс пытается начать новую жизнь. Он соглашается работать на азиатскую мафию. Но проникая все глубже в криминальный мир родного города, он понимает, что не может спокойно смотреть на творящееся в нем беззаконие. Когда от рук бандитов погибает его возлюбленная Изабель, Джоуи решает восстановить справедливость. Он начинает расследование, которое ведет его на самый верх преступного синдиката.',1,40,23,1372506120,10853,'6.6','6.2',1402485749,'','',0,2013,5,3,0,0,1372507095),(143,145,'Гагарин. Первый в космосе ',1,0,'Фильм посвящен первым шагам человечества на пути освоения космоса и непосредственно судьбе первого космонавта Ю. А. Гагарина. Основной лейтмотив — борьба за право быть первым: соревнование в первом отряде космонавтов; конкуренция технологий в ракетостроении; противостояние сверхдержав — СССР и США.\n\nВ первый отряд космонавтов отбирали из трёх тысяч летчиков-истребителей по всей стране. В легендарную двадцатку попали лучшие из лучших. Кто из них полетит первым, не знал никто. На этом пути пришлось бороться не только с земным притяжением…',1,44,46,1372859595,2765,'8.0','7.4',1402508222,'','',0,2013,2,1,0,0,1372860026),(144,146,'Отвязные каникулы / Spring Breakers',1,1,'Четыре ученицы колледжа были лучшими подругами, начиная со школьной скамьи. Теперь они живут в скучном общежитии и жаждут приключений. Впереди весенние каникулы, и очень хочется провести их весело и незабываемо. Девчонки решают подзаработать денег, чтобы хватило оторваться по полной.\n\nПравда, способ заработка денег героини выбирают не совсем обычный. Судьба сводит их с одним весьма сомнительным типом, торговцем наркотиками и оружием, и это знакомство обещает предоставить им массу острых ощущений, на которые они уже не могли и надеяться. Как далеко способны зайти девушки, чтобы получить каникулы, которые, уж будьте уверены, они никогда не забудут?',1,34,0,1372859918,13262,'6.0','5.2',1402509142,'','',0,2013,2,1,0,0,1372860026),(145,147,'Транс / Trance',1,0,'Аукционер Саймон не в силах противостоять искушению — вступает в сговор с бандой грабителей и организует похищение уникального лота стоимостью в миллионы долларов. Однако налет оканчивается не совсем так, как он предполагал вначале. Аукционера оглушают ударом тупого предмета по голове, в результате которого он теряет какие бы то ни было воспоминания о том, что произошло.\n\nРазумеется, он также забывает, куда спрятал ценную картину. Пытками добиться ответа от ничего не понимающего Саймона не удается. Тогда главарь банды решает нанять психотерапевта, чтобы она смогла выудить ценную информацию из поврежденного мозга заложника. По мере того, как девушка пробивается сквозь нейронную защиту, ставки растут как на дрожжах. Границы между страстью и жестокостью, реальностью и вымыслом тускнеют и вовсе готовы испариться. В конечном итоге становится не ясно — кто же у кого в заложниках?',1,44,49,1372870798,4245,'7.8','7.2',1402468144,'','',0,2013,1,3,0,0,1373017998),(146,148,'G.I. Joe: Бросок кобры 2 / G.I. Joe: Retaliation',1,1,'Во второй части отряд «G.I. Joe» вновь объявит вызов группировке «Кобра» и вступит в противостояние с правительством…',1,45,43,1373476242,17573,'6.0','6.2',1402485688,'','',0,2013,1,1,0,0,1373476703),(147,149,'Решала',1,0,'Фильм о двух братьях. Старший — юрист, успешный человек, к нему обращаются за решением различных вопросов. Но ему предстоит решить самую главную задачу своей жизни-вытащить младшего брата из криминальной передряги.',1,19,10,1373622327,4004,'','6.7',1402391208,'','',0,2012,2,1,0,0,1373645296),(153,155,'Сезон убийц (Шрапнель) / Killing Season',1,0,'История о ветеранах войны в Боснии — американце и сербе, которые, спустя много лет после событий в Европе, устраивают свою личную Третью мировую войну, пытаясь свести счеты.',1,30,44,1374046086,4813,'6.5','5.8',1402495733,'','',0,2013,1,4,0,0,1374046841),(154,156,'Тихоокеанский рубеж / Pacific Rim',1,1,'Когда из морских глубин поднялись легионы чудовищ, известных как Кайдзу, началась война, которой суждено было забрать миллионы жизней и свести «человеческие ресурсы» почти к нулю всего за несколько лет. Чтобы сражаться с пришельцами, было создано специальное оружие: огромные роботы, названные Джегерами, они управлялись одновременно двумя пилотами, чьи сознания соединены с помощью нейронной связи. Но даже Джегеры оказываются почти бессильны перед лицом безжалостных Кайдзу. На грани поражения у защитников человечества нет выбора, кроме как обратиться к двум весьма сомнительным героям — никому не нужному бывшему пилоту и неопытному стажеру — которые объединились, чтобы повести в бой некогда легендарного, но сейчас устаревшего Джегера. Вместе они оказываются единственной надеждой человечества, последним препятствием перед надвигающимся апокалипсисом.',2,2,21,1374387514,37367,'7.9','7.6',1402467538,'','',0,2013,2,1,0,0,1374390652),(149,151,'Гадкий я 2 / Despicable Me 2',1,1,'Стив Карелл\nКристен Уиг\nБенджамин Брэтт\nМиранда Косгров\nРасселл Брэнд\nКен Жонг\nСтив Куган\nЭлси Фишер\nДэна Гайер\nМойзес Ариас',1,38,0,1373797051,18239,'7.8','8.1',1402514200,'','',0,2013,1,4,0,0,1373797442),(155,157,'Обливион / Oblivion',1,1,'Можно ли скучать по месту, в котором никогда не был, мечтать о девушке, которую никогда не видел? Добро пожаловать в будущее! Мы больше не можем называть Землю своим домом. Мы выиграли войну, но не смогли сохранить планету…',2,4,42,1374757782,13199,'7.1','7.4',1402380558,'','',0,2013,1,1,0,0,1374758461),(156,158,'Судная ночь / The Purge',1,0,'Мир будущего — мир без преступности… безработицы… войн. И все это благодаря одной ночи в году, когда можно отправить на тот свет любого — злобного босса, шумных соседей, надоевших родственников. В Судную ночь дозволено все — главное дожить до рассвета.',1,25,11,1374856173,12744,'5.6','6.0',1402510628,'','',0,2013,1,1,0,0,1374856433),(157,159,'Росомаха: Бессмертный / The Wolverine',1,1,'Новая глава приключений Росомахи развернётся в Японии, где Логану предстоит выяснить, что острее — когти Росомахи или меч Серебряного Самурая',1,58,45,1375097421,55239,'7.4','6.9',1402499165,'','',0,2013,3,1,0,0,1375105518),(158,160,'Марафон',1,0,'Жизнь Толика не удалась, спортивная карьера не состоялась, жена ушла к другому. Неуспешный, нелюбимый, безнадежный он потерял веру в себя. Все меняет случайная встреча со странной незнакомкой Анной Ильиничной, которая предлагает ему принять участие в необычном марафоне в далекой Америке…',1,35,21,1375351031,1799,'6.8','6.4',1401694554,'','',0,2013,1,1,0,0,1375351790),(159,161,'Хоббит с татуировкой дракона',1,0,'На далёкой планете Пандоре беспросветно застрял известный галактический автостопщик Артур Дент (в оригинале Бильбо). И однажды к нему заявляется старый иксмен Магнето (в оригинале Гэндальф), растерявший суперсилу и остатки разума, но сохранивший шило в одном месте. Он втягивает Артура в лихую авантюру – охоту на мифического термоядерного динозавра – да ещё и в компании странных бородатых шахтёров, поклоняющихся Чаку Норрису.',2,13,13,1375351430,8869,'','',1402499188,'','',0,2013,1,1,0,0,1375351790),(160,162,'Одинокий рейнджер / The Lone Ranger',1,1,'История блюстителя закона Джона Рида, который с помощью индейца Тонто стал легендарным мстителем в маске, стоящим на защите справедливости. Тонто с юмором и небылицами повествует о тех приключениях, которые пришлось пережить двум непохожим друг на друга героям, сведенным судьбой для того, чтобы вместе сражаться против общего врага. Им приходится противостоять жадности и коррупции во времена, когда появление первых железных дорог изменило представление о власти и могуществе в мире.',2,20,36,1375692198,14541,'6.7','7.0',1402494816,'','',0,2013,5,3,0,0,1375692636),(161,163,'Смурфики 2 / The Smurfs 2',1,0,'Гаргамел создаёт Хакуса и Векси, как две капли воды похожую на смурфиков злобную парочку, надеясь всё-таки обрести магическую силу. Когда он узнаёт, что лишь настоящий смурф может дать ему то, что он хочет, и лишь Смурфетта способна превратить Хакуса и Векси в настоящих смурфов, Гаргамел похищает Смурфетту и берёт её с собой в Париж, планируя сделать её своей прислужницей. Но смурфики — Папа, Растяпа, Смельчак, Ворчун, Красавчик, Благоразумник — и их друзья из Нью-Йорка этого так не оставят. Тем более что к ним присоединился новорождённый Голубчик.',1,37,8,1375692502,11855,'4.9','6.4',1402496078,'','',0,2013,5,3,0,0,1375692636),(162,164,'Эпик / Epic',1,1,'После долгой разлуки юная Мэри Кэтрин возвращается в дом, где отшельником живет ее отец, безумный профессор Бомба. Однако тот совсем не обращает внимания на дочь и одержим лишь одной идеей — изучить скрытый от посторонних глаз таинственный лесной мир. Девушка отказывается верить, что под ногами человечества идет вечная борьба между армиями, воюющими на сторонах добра и зла. Чудесным образом Мэри Кэтрин уменьшается в размерах и знакомится с маленькими воинами. Теперь от нее зависит спасение не только волшебного лесного, но и реального человеческого мира…',1,42,56,1375882554,7982,'6.7','7.2',1402505696,'','',0,2013,4,1,0,0,1375883453),(163,165,'После нашей эры / After Earth',1,0,'События разворачиваются через тысячу лет после катастрофы, вынудившей человечество покинуть Землю. Новым домом становится планета под названием Нова Прайм. Легендарный генерал Сайфер Рейдж возвращается с очередного боевого задания в семью, которая раньше обходилась без его родительского внимания, чтобы стать отцом своему 13-летнему сыну Китаю. Во время астероидной бури летательный аппарат с папой и сыном на борту терпит крушение, падая на незнакомую и опасную Землю. И пока Рейдж-старший на последнем дыхании лежит среди обломков своего корабля, сын должен пересечь враждебный ландшафт, чтобы запустить их спасательный маячок. Ни о чем большем юноша в своей жизни не мечтал: быть солдатом, как отец, — его заветное желание. Сегодня у него есть шанс проявить себя.',1,30,27,1375883009,12745,'4.8','6.2',1402502844,'','',0,2013,4,1,0,0,1375883453),(164,166,'Притворись моим парнем / 20 ans d\'?cart',1,1,'У редактора модного глянцевого журнала Алисы Лантенс безупречный вкус, отличное резюме и репутация «железной леди». Но однажды начальство намекает, что возглавлять молодежное издание должен кто-то более смелый и провокативный. Решение приходит неожиданно: по нелепой случайности по миру шоу-бизнеса разносится слух о ее романе с 18-летним студентом. Оказывается, что подмоченная репутация — именно то, что нужно для продвижения по карьерной лестнице! Но куда деваться от парня, который и вправду влюбился?',1,32,36,1376049335,8856,'6.9','7.3',1402257995,'','',0,2013,2,3,0,0,1376049609),(165,167,'Турбо / Turbo',1,1,'Ничто так не раздражает темпераментную, мечтающую о скорости улитку с говорящим именем Турбо, как неспешная жизнь, медленные разговоры, заторможенные соседи. Пусть наш герой выглядит большим чудаком в этом вялом, неторопливом мире, пусть он идёт вопреки закону природы о «рождённом ползать», но если в сердце горит «пламенный мотор», а душа верит в чудо, оно просто не имеет права не произойти!',1,26,20,1376049496,16030,'7.1','6.3',1402496058,'','',0,2013,5,3,0,0,1376049609),(166,168,'Великий Гэтсби / The Great Gatsby',1,0,'Весной 1922 года, в эпоху разлагающейся морали, блистательного джаза и «королей контрабандного алкоголя», Ник Каррауэй приезжает из Среднего Запада в Нью-Йорк. Преследуя собственную американскую мечту, он селится по соседству с таинственным, известным своими вечеринками миллионером Джеем Гэтсби, а на противоположном берегу бухты проживают его кузина Дэйзи и её муж, повеса и аристократ, Том Бьюкенен. Так Ник оказывается вовлечённым в захватывающий мир богатых — их иллюзий, любви и обманов. Он становится свидетелем происходящего в этом мире и пишет историю невозможной любви, вечных мечтаний и человеческой трагедии, которые являются отражением современных времен и нравов.',2,22,5,1376233600,4036,'7.4','8.3',1402257195,'','',0,2013,1,3,0,0,1376234832),(167,169,'Копы в юбках / The Heat',1,1,'Агенту ФБР и бостонскому полицейскому доверено ответственное задание: выйти на след и обезвредить опасного преступника. И это даже хорошо, что копы — женщины, ведь бандит-то — русский. А непредсказуемости русской смекалки можно противопоставить только столь же непредсказуемую женскую логику.',1,52,2,1376233845,19106,'7.1','7.3',1402514967,'','',0,2013,1,3,0,0,1376234832),(168,170,'Кровью и потом: Анаболики / Pain & Gain',1,1,'Марк Уолберг\nДуэйн Джонсон\nЭнтони Маки\nТони Шэлуб\nЭд Харрис\nРоб Кордри\nРебел Уилсон\nБар Пали\nКен Жонг\nМайкл Рисполи',2,9,36,1376345634,17930,'6.8','6.8',1402346121,'','',0,2013,1,1,0,0,1376346248),(170,172,'Мы – Миллеры / We\'re the Millers',1,1,'Дэвид Берк — мелкий торговец наркотиками. Среди его клиентов — повара и скучающие домохозяйки. Детям он наркотики не продаёт и поэтому считает себя принципиальным человеком. Дэвид действительно хорошо относится к детям, но это не остается безнаказанным — он пытается помочь подросткам, попавшим в беду, и на него нападают хулиганы-панки. Они отбирают у него наркотики и деньги, и наш герой оказывается в отчаянном положении. Ведь ему нечем расплатиться с его поставщиком Брэдом. Единственный выход — подрядиться на доставку крупной партии наркотиков через границу…',1,44,41,1377719419,12664,'7.2','7.9',1402457275,'','',0,2013,3,3,0,0,1377719897),(171,173,'Стартрек: Возмездие / Star Trek Into Darkness',1,1,'Вернувшись на Землю, команда корабля «Энтерпрайз» обнаруживает, что деятельность и принципы их организации подорваны изнутри. Флот скован необъяснимым ужасом и бездействует, пока мир все глубже погружается в бездну.\n\nКапитан Кирк берет на себя руководство операцией по поимке злодея, ответственного за этот хаос и способного уничтожить все человечество.\n\nВ запутанной игре не на жизнь, а на смерть, любовь и дружба будут принесены в жертву ради единственного, что осталось у Кирка — его команды.',2,12,6,1377719663,14285,'8.0','8.1',1402332561,'','',0,2013,3,1,0,0,1377719897),(178,180,'Мальчишник: Часть III  / The Hangover Part III',1,1,'В этот раз никакой свадьбы. Никакого мальчишника. Казалось бы, что могло пойти не так? Но когда Волчья стая оказывается на дороге, все ставки снимаются.',1,38,16,1377934583,12846,'6.6','6.1',1402422690,'','',0,2013,4,3,0,0,1377935411),(179,181,'Призрачный патруль / R.I.P.D.',1,0,'Детективы из загробного департамента расследуют преступления по ту сторону могилы и гоняются за не в меру ретивой нечистью. Молодой коп, после гибели от руки неизвестного злоумышленника угодивший в мир иной, в обмен на помощь при расследовании собственного убийства обязуется следующие сто лет посвятить службе в R.I.P.D. и, получив в напарники брутального стрелка эпохи вестернов, выходит на борьбу с неупокоившимся злом.',1,35,50,1377934901,18508,'5.4','6.4',1402428386,'','',0,2013,4,1,0,0,1377935411),(180,182,'Одноклассники 2 / Grown Ups 2',1,1,'После того как Ленни Федер переезжает с семьей обратно в родной город, он и его друзья извлекут немало уроков, когда их дети окончат школу…',1,34,17,1378391449,19377,'5.2','6.1',1402488984,'','',0,2013,2,1,0,0,1378391927),(181,183,'Мерзлая земля / The Frozen Ground',1,0,'Все были уверены, что Роберт Хансен — приличный семьянин, владелец пекарни и славный охотник. Никто не подозревал, что на самом деле он — безжалостный маньяк, который похитил и убил более двадцати женщин. И только 17-летней Синди Полсон удалось сбежать от убийцы. Она наводит на след маньяка полицейского, который начинает опасное расследование. Ему никто не верит: Хансен — слишком приличный человек для такого обвинения… Но упорный коп знает свое дело и должен дойти до конца…',1,45,33,1378391776,4920,'6.4','6.3',1402445158,'','',0,2013,4,1,0,0,1378391927),(182,184,'Война миров Z / World War Z',1,1,'Сотрудник ООН Джерри Лэйн наперегонки со временем пытается остановить заражение, способное полностью истребить человечество.',2,3,3,1378929698,34091,'7.2','7.3',1402500041,'','',0,2013,1,1,0,0,1378975812),(183,185,'Риддик / Riddick',1,1,'Преданный своими и брошенный умирать на пустынной планете, Риддик сражается с хищниками за жизнь и становится сильнее и опаснее себя прежнего. Открывшие на него охоту галактические наемники оказываются пешками в грандиозном плане отмщения. С врагами, возникающими на его пути тогда, когда это нужно самому Риддику, он начинает поход во имя мести, чтобы в конечном счете вернуться на родную Фурию и спасти ее от уничтожения',1,54,41,1378975701,38067,'7.2','7.1',1402490443,'','',0,2013,2,1,0,0,1378975812),(752,754,'Паранормальное явление: Метка Дьявола / Paranormal Activity: The Marked Ones',1,0,'Потусторонняя сила, терроризировавшая героев предыдущих серий, вновь вырвалась на свободу в поисках новых жертв…',1,24,0,1396193542,6319,'4.4','5.1',1402514642,'','',0,2013,2,1,0,0,1396193659),(185,187,'Конец света 2013: Апокалипсис по-голливудски / This Is the End',1,1,'Джей Барушель приезжает в Лос-Анджелес, чтобы посетить старого друга и коллегу, актера Сета Рогена, который пригласил Барушеля на новоселье, которое организовывает Джеймс Франко. На не очень приличную вечеринку приехали многие знаменитости. Барушелю неудобно среди такого количества людей, он практически не знает лично таких знаменитостей, как: Джона Хилл, Кристофер Минц-Плассе, Майкл Сера, Крейг Робинсон, Эмма Уотсон и Ченнинг Татум. Роген, чтобы немного успокоить друга, сопровождает его в магазин за сигаретами.\n\nВ магазине лучи синего света с неба вдруг унесли несколько покупателей. Перепуганные Роген и Барушель бегут в дом Франко на фоне взрывов, автомобильных аварий, а также массового хаоса, но на вечеринке синие лучи никого не тронули. Подвыпившие гости не верят россказням Барушеля и объявляют его сумасшедшим, но через несколько секунд слышат снаружи грохот…',1,47,0,1380091267,16275,'7.3','6.6',1402503554,'','',0,2013,1,1,0,0,1380091497),(191,193,'Элизиум: Рай не на Земле',1,1,'В 2154 году существует два класса людей: очень богатые, живущие на чистой, созданной руками человека, космической станции под названием Элизиум и остальные, живущие на перенаселённой разрушенной Земле. Безжалостный правительственный чиновник, амбициозная министр обороны Делакур, не остановится ни перед чем для применения анти-иммиграционных законов и сохранения роскошного образа жизни граждан Элизиума. Когда неудачника Макса загоняют в угол, он соглашается взять на себя сложную миссию, которая в случае успеха не только спасёт ему жизнь, но и может привести к равенству этих поляризованных миров.',1,49,0,1380718195,18774,'7.0','7.0',1402514664,'','',0,2013,4,3,0,0,1381764314),(192,194,'Околофутбола',1,0,'Фильм о самой закрытой части футбольных болельщиков — околофутбольных хулиганах. Они — самые агрессивные и жестокие представители мира футбольных фанатов. Они — элита околофутбола. Кем бы они ни были в обычной жизни — студентами или банкирами, музыкантами или автомеханиками, на самом деле все они — одна «фирма». Попасть в «фирму» очень сложно, но если ты в ней оказался — это на всю жизнь. И обратного пути не',1,40,0,1381763892,18033,'7.4','7.0',1402515082,'','',0,2013,2,1,0,0,1381764314),(193,195,'Кадры / The Internship',1,0,'Билли и Ник всю жизнь занимаются продажами. Но новый компьютерный мир рушит их карьеру. Стараясь доказать, что они не отстали от жизни, они бросают вызов судьбе, получив желанную стажировку в компании Google вместе с командой лучших студентов колледжей. Но получить доступ в этот фантастический мир — это только половина дела. Сейчас им придется выдержать конкуренцию с самыми лучшими техническими гениями, чтобы доказать, что необходимость — это мать обновления.',1,59,0,1381764124,6207,'6.3','7.1',1402499320,'','',0,2013,2,1,0,0,1381764314),(194,196,'Пипец 2 / Kick-Ass 2',1,0,'В реальной жизни не встретишь супергероя из комиксов, зато в ней есть настоящие герои. Харизматичный Пипец и гламурная Убивашка обрели новую команду поддержки во главе с Полковником Америка. Но кроме обычных мафиози, над городом нависает новая угроза — молодой мажор с очень дурным характером и целой армией отмороженных наемников.',1,43,0,1382985578,12400,'7.0','6.5',1402513440,'','',0,2013,2,1,0,0,1382985760),(195,197,'Философы. Урок выживания',1,0,'В международной школе в Джакарте таинственный учитель философии в качестве выпускного экзамена предлагает 20 студентам провести эксперимент. Этот опыт будет самым экстремальным, с которым они когда-либо сталкивались.\n\nИспользуя только силу логики, студенты должны выбрать, кто из них будет достоин получить место в подземном бункере — единственном месте, где можно спастись от приближающейся ядерной катастрофы. Бункер рассчитан на десять человек, а значит, тех, кого не выбирают, ожидает жестокая смерть. Реальность классной комнаты эффектно перетекает в воображаемый, но в то же время пугающий мир надвигающегося апокалипсиса…',1,47,0,1383133336,5066,'6.1','5.8',1402414926,'','',0,2013,2,1,0,0,1383136009),(202,204,'РЭД 2 / Red 2',1,1,'Вышедший на пенсию тайный агент ЦРУ Фрэнк Мозес объединяется с командой старых друзей, элитных оперативников, с целью найти пропавшее оружие массового уничтожения. Чтобы его заполучить, придётся прорываться сквозь армии безжалостных наёмников, террористов и всегда жаждущих власти политиков.\n\nМиссия приводит Фрэнка и его разношёрстную команду вышедших на пенсию убийц в Париж, Лондон и Москву. В их арсенале есть только хитрость, старая сноровка и помощь друг друга, чтобы спасти мир и при этом самим остаться в живых.',1,56,0,1383756795,10531,'6.9','7.2',1402512413,'','',0,2013,2,3,0,0,1383757623),(203,205,'Два ствола / 2 Guns',1,1,'Это история двух грабителей, которые на самом деле не те, кем кажутся. Один из них — агент из управления по борьбе с наркотиками, а другой — тайный агент разведки ВМС. Сами того не желая, они занимаются расследованием дел друг друга, а также воруют деньги у мафии. Через некоторое время героям придется украсть 50 миллионов долларов у ЦРУ.',1,49,0,1384153705,22525,'7.0','7.3',1402513952,'','',0,2013,3,1,0,0,1384154140),(204,206,'Географ глобус пропил',1,0,'Молодой биолог Виктор Служкин от безденежья идет работать учителем географии в обычную пермскую школу. Он борется, а потом и дружит с учениками, конфликтует с завучем, ведет девятиклассников в поход — сплавляться по реке. Еще он пьет с друзьями вино, пытается ужиться с женой и водит в детский сад маленькую дочку. Он просто живет…',2,0,0,1384153992,3256,'8.0','8.0',1402205699,'','',0,2013,2,1,0,0,1384154140),(218,220,'Мачете убивает / Machete Kills',1,0,'Правительство США вербует Мачете для миссии, которую не под силу выполнить простому смертному. Мачете прорывается в Мексику, чтобы схватить безумного лидера карательного отряда и эксцентричного миллиардера, торгующего оружием, который, в свою очередь, лелеет мечту начать войну планетарного масштаба и запустить смертельно опасное оружие в космос. И только Мачете может предотвратить этот глобальный хаос.',1,47,0,1384760142,12601,'6.2','6.2',1402513391,'','',0,2013,2,1,0,0,1384760519),(219,221,'Страсти Дон Жуана / Don Jon',1,0,'Комичная история современного ловеласа, который из каждого любовного приключения вынужден спасаться бегством. Он еще не знает, что недалек тот час, когда ему все-таки придется остепениться…',1,30,0,1384760315,7475,'7.2','6.5',1402494844,'','',0,2013,2,1,0,0,1384760519),(222,224,'Тор 2: Царство тьмы / Thor: The Dark World',1,1,'Продолжение приключений одного из членов команды Мстителей, скандинавского бога Тора, которому на этот раз в одиночку предстоит защитить Землю и все девять миров от нашествия неизвестного врага.\n\nМогучему Тору предстоит вновь сразиться за восстановление порядка в галактике, встретившись лицом к лицу с древней инопланетной расой, ведомой злодеем Малекитом, жаждущим установить в девяти мирах власть тьмы. Столкнувшись с врагом, более могущественным чем сам Один и всё воинство Асгарда, Тор должен собрать силы для решающей битвы. Его ждёт опасное путешествие и долгожданная встреча со своей земной возлюбленной Джейн Фостер. Сможет ли Тор рискнуть самым дорогим, чтобы не дать тьме воцариться на просторах вселенной?',1,52,0,1384980752,37703,'7.7','7.9',1402513488,'','',0,2013,5,3,0,0,1385569324),(206,208,'Малавита / The Family',1,1,'Что вы знаете о своих соседях? Особенно о тех, которые заявляются среди ночи… Так, однажды на тихой улочке провинциального французского городка поселился писатель по фамилии Блейк, со своим семейством и собакой Малавитой. На этом многовековое спокойствие города закончилось. Почему сгорел местный супермаркет? Чем рискует медлительный водопроводчик? Что лежит в рюкзаке у милого парня в бежевых бриджах?',1,51,0,1384211727,4438,'6.5','7.1',1402514678,'','',0,2013,2,1,0,0,1384212216),(223,225,'Голодные игры: И вспыхнет пламя / The Hunger Games: Catching Fire',1,1,'Сумев выжить на безжалостных Голодных играх, Китнисс Эвердин и Пит Мелларк возвращаются домой. Но теперь они в еще большей опасности, так как своим отказом играть по правилам на Арене бросили вызов Капитолию. По традиции следующие, юбилейные, Голодные игры должны стать особенными, и в этот раз в них участвуют только победители прошлых лет. Китнисс и Пит вынуждены вновь выйти на Арену, где будут соперничать с сильнейшими. Правила игры меняются. Арена еще опасней, масштаб еще больше, ставки еще выше!',2,26,0,1385566087,31422,'8.3','8.2',1402512403,'','',0,2013,2,1,0,0,1385569324),(224,226,'Капитан Филлипс / Captain Phillips',1,1,'В начале апреля 2009 года, близ берегов Африки, несколько сомалийских пиратов атакуют и пытаются захватить массивный контейнеровоз MV Maersk Alabama. Команда корабля активно сопротивляется и в конце концов не даёт взять себя в плен. Захватчики вынуждены ретироваться и покинуть судно на небольшом катере, прихватив с собой немолодого капитана Ричарда Филлипса…',2,14,0,1386354158,7735,'8.1','7.9',1402497063,'','',0,2013,1,2,0,0,1386354749),(225,227,'Индюки: Назад в будущее / Free Birds',1,0,'Индюк Реджи вырос на обычной ферме, его жизнь была скучной и однообразной, как и у других птиц. Однако он отличался от сородичей тем, что умел пользоваться смекалкой и понимал, зачем его кормят. Поедание индейки на День Благодарения — знаменитая американская традиция, которая определяет смысл существования всех индюков на этой ферме. Однажды у Реджи появилась возможность кардинально изменить ситуацию: вместе с безумным приятелем Джейком они отправляются в необычное путешествие на машине времени. Основная задача — вернуться во времена, когда зарождалась традиция приготовления индейки на праздник, и изменить ход истории.',1,31,0,1386354647,9123,'5.0','6.1',1402506009,'','',0,2013,2,1,0,0,1386354749),(246,248,'Va-банк / Runner Runner',1,1,'Чтобы оплачивать учёбу в колледже, Ричи погружается в мир азартных игр онлайн. Когда удача изменяет ему, он отправляется на Коста-Рику, чтобы помериться силами с настоящим асом игрового бизнеса. Тот видит в Ричи родственную душу и вводит его в свою игру. Но когда степень опасности возрастает, а ставки достигают невероятных высот, Ричи вдруг отчётливо понимает, что его новый босс вот-вот совершит непоправимое, и пытается поменяться с ним ролями.',1,31,0,1387713638,4569,'5.4','6.2',1402510297,'','',0,2013,2,1,0,0,1387713870),(244,246,'Один дома / Home Alone',1,0,'Американское семейство отправляется из Чикаго в Европу, но в спешке сборов бестолковые родители забывают дома… одного из своих детей. Юное создание, однако, не теряется и демонстрирует чудеса изобретательности. И когда в дом залезают грабители, им приходится не раз пожалеть о встрече с милым крошкой.',1,43,0,1387544876,3893,'7.3','8.2',1402510612,'','',0,1990,2,1,0,0,1387713870),(252,254,'Рождественские каникулы / Christmas Vacation',1,0,'В доме Грисуолдов празднуют Рождество. Время, когда дарят подарки, звучат гимны, радостно мерцают огоньки рождественской елки… Но погодите-ка: эта елка вовсе не мерцает. Она вся в огне! Рождество — прекрасное время для Кларка Грисуолда и его семьи.\n\nКларк — это стихийное бедствие, которое может обрушиться на вас в любой момент. Теперь Кларк хочет во что бы то ни стало устроить своей семье «самый веселый старомодный семейный праздник Рождества из всех. какие были, есть и будут».\n\nНу и ну! В это трудно поверить, пока вы не увидите все собственными глазами. 25 000 лампочек на крыше дома Грисуолдов. Взрывающийся индюк на столе… Вот это Рождество!',1,37,0,1387961832,1147,'7.4','7.3',1402498971,'','',0,1989,2,1,0,0,1387962138),(253,255,'Один дома 2: Затерянный в Нью-Йорке / Home Alone 2: Lost in New York',1,0,'Самый маленький герой Америки устраивает большой переполох в Нью-Йорке! Кевин МакКалистер вернулся! Но теперь он один не дома, а в Нью-Йорке и у него достаточно денег и кредитных карточек, чтобы превратить Большое Яблоко в собственную площадку для игр.\n\nНо, как всегда, Кевину не суждено быть долго одному: его старые приятели ― жулики Гарри и Марв ― сбежали из тюрьмы, куда они попали стараниями Кевина. И надо же им было попасть именно в тот город, где Кевин планировал поразвлечься! Новые западни и ловушки уже ждут горе-бандитов.',1,59,0,1387962085,6078,'6.3','7.9',1402464120,'','',0,2013,2,1,0,0,1387962138),(1067,1069,'3 дня на убийство / 3 Days to Kill',1,1,'В секретной лаборатории ученые разработали препарат, который позволяет человеку справиться с любой неизлечимой болезнью. Руководство спецслужб предлагает принять это лекарство экс-агенту спецслужб Итану Раннеру, которому врачи объявили смертельный диагноз. Но он должен выполнить еще одно задание, которое, впрочем, может стоить ему жизни. Теперь вокруг Раннера начинают происходить странные вещи. Что это — галлюцинации, побочный эффект от таблеток или мир действительно полон ужаса и кошмара?',1,17,0,1400314561,2936,'6.2','6.5',1402513409,'','',0,2014,1,1,0,0,1400315058),(374,376,'Олдбой / Oldboy',1,0,'Фильм рассказывает о рекламщике, которого некто похитил и 20 лет продержал в одиночной камере, никак не объясняя своих мотивов. Столь же неожиданно получив однажды свободу, он решает разыскать того, кто организовал его похищение, и обнаруживает, что неизвестный злодей продолжает мучить его загадками. Погоня за местью приводит его к юной социальной работнице и некоему человеку, в руках которого якобы находится ключ к его спасению.',0,0,0,1392200955,3590,'4.9','6.4',1402425405,'','',0,2013,2,1,0,0,1392201508),(375,377,'Последний рубеж / Homefront',1,0,'Фил Брокер — бывший агент из отдела борьбы с наркотиками. Фил переезжает в небольшой город вместе с семьей в надежде забыть прошлое. Но он узнает, что город только со стороны кажется тихим и спокойным местом, на самом деле он кишит насилием, наркотиками, а всем этим заправляет злодей по кличке Аллигатор…',1,36,0,1392201137,6374,'6.2','6.7',1402507580,'','',0,2013,4,3,0,0,1392201508),(264,266,'Хоббит: Пустошь Смауга / The Hobbit: The Desolation of Smaug',1,1,'После успешного перехода через Туманные горы Торин и компания вынуждены обратиться за помощью к могучему незнакомцу, прежде чем отправиться в опасное Лихолесье без волшебника. Их компания обязана завершить своё путешествие к Одинокой горе, где Бэггинсу нужно будет найти потайную дверь, чтобы добраться до клада Смауга…',2,41,0,1388397575,21682,'8.3','8.4',1402512912,'','',0,2013,2,3,0,0,1388397682),(275,277,'Тёмный мир: Равновесие',1,0,'Каждый день они крадут твои силы, твои эмоции, твою любовь. Мы называем их Тени. Работа таких, как мы — доставлять их обратно в Тёмный мир. Надвигается катастрофа, и человечество может оказаться во власти тьмы…\n\nИ только мы можем сохранить равновесие.',1,35,0,1388487289,10008,'3.9','4.3',1402502881,'','',0,2013,2,1,0,0,1388487880),(276,278,'Молода и прекрасна / Jeune & jolie',1,0,'Семнадцатилетняя Изабель погружается в бездонный мир любви, в поиски себя. Не столько из-за денег, сколько ради удовольствия, она встречается с немолодыми клиентами в гостиничных номерах. Близкие Изабель не подозревают, чем одержима умная и тонкая девушка. Но однажды умирает один из ее постоянных клиентов…',1,35,0,1388487800,6679,'7.1','7.1',1402510274,'','',0,2013,2,1,0,0,1388487880),(277,279,'Ёлки 3',1,1,'Спустя два года они снова с нами: любимые герои «Ёлок» в самых невероятных новогодних историях. Боря и Женя, чьи годовалые дети в канун праздника доведут друзей до психушки. Маленькая девочка Настя, чьи родители разлучат ее влюбленных друг в друга собак. Лыжник и сноубордист в самой экстремальной в их жизни гонке — от военкома. И профессор из Екатеринбурга Андрей, чья любвеобильность вновь не доведет его до добра, а только до проруби в минус 30.\n\nПод бой курантов этих и новых героев «Ёлок» объединит бумеранг добра. Завершая свой круг, он заслуженно вернётся к каждому, кто его однажды запустил — кому улыбками и объятиями любимых и друзей, кому — праздничным настроением и соответствующим градусу состоянием, а кому-то… телефоном в холодце!',1,40,0,1388513966,17527,'6.1','7.1',1402514543,'','',0,2013,2,1,0,0,1388514210),(284,286,'Бойфренд из будущего / About Time',1,0,'Тиму повезло — он молодой, симпатичный, многообещающий адвокат, а еще он… умеет перемещаться во времени. И чтобы очаровать девушку своей мечты, он готов повторять первое свидание вновь и вновь. Воистину, любовь с первого взгляда не всегда выходит с первого раза…',2,3,0,1388746423,4835,'7.8','8.1',1402502841,'','',0,2013,2,1,0,0,1388746617),(285,287,'Невероятная жизнь Уолтера Митти / The Secret Life of Walter Mitty',1,1,'Кто сказал, что в сердце маленького человека не могут жить великие мечты? Даже скромному и незаметному служащему хочется иногда совершить пусть безумные, но геройские поступки, поверить в свою силу и мужество. Почему всех спасать должны исключительно супермены?',1,54,0,1388831560,27710,'7.8','8.1',1402512860,'','',0,2013,2,1,0,0,1388835513),(286,288,'Телекинез / Carrie',1,1,'Невзрачная старшеклассница по имени Кэрри с рождения обладает способностями телекинеза. Давление со стороны фанатично религиозной мамочки и постоянные издевки сверстников лишь способствует развитию ее сверхъестественных способностей. На выпускном одноклассники решают жестоко подшутить над ней, что приводит к фатальным последствиям.',1,40,0,1388831971,11349,'6.0','6.3',1402510210,'','',0,2013,3,3,0,0,1388835513),(287,289,'Холодное сердце / Frozen',1,1,'Когда древнее предсказание сбывается и королевство погружается в объятия вечной зимы, трое бесстрашных героев — принцесса Анна, отважный Кристофф и его верный олень Свен — отправляются в горы, чтобы найти сестру Анны, Эльзу, которая может снять со страны леденящее заклятие. По пути их ждет множество увлекательных сюрпризов и захватывающих приключений: встреча с мистическими троллями, знакомство с очаровательным снеговиком по имени Олаф, горные вершины покруче Эвереста и магия в каждой снежинке. Анне и Кристоффу предстоит сплотиться и противостоять могучей стихии, чтобы спасти королевство и тех, кто им дорог…',1,49,0,1389196628,23061,'8.1','8.2',1402501666,'','',0,2013,2,3,0,0,1389196924),(309,311,'Starперцы / Last Vegas',1,1,'Билли, Пэдди, Арчи и Сэм дружат больше полувека. И когда убежденный холостяк Билли наконец-то делает предложение своей юной подружке, великолепная четверка отправляется в Лас-Вегас, чтобы скинуть с себя груз прожитого и зажечь как в последний раз. Великовозрастные гуляки и не подозревают, как за десятилетия эволюционировал Город Грехов…',1,45,0,1389733751,6188,'6.9','7.2',1402495707,'','',0,2013,4,1,0,0,1389734152),(310,312,'47 ронинов / 47 Ronin',1,1,'Таинственный странник, преданный всеми, проданный в рабство, избранный судьбой вершить месть, станет одним из 47 воинов, бросивших вызов смерти. Явившись из другого мира, он восстанет против темных сил, чтобы защитить свою запретную любовь.',1,59,0,1389871527,26487,'6.7','7.0',1402509774,'','',0,2013,2,1,0,0,1389872056),(399,401,'РобоКоп / RoboCop',1,1,'2028 год. Международный конгломерат ОмниКорп лидирует в производстве робототехники. Благодаря разработкам компании Америка успешно побеждает в войнах по всему миру. Но теперь пришло время применить технологию на американской земле. Алекс Мерфи — любящий муж, отец и отличный полицейский, оберегающий порядок в Детройте, получает на службе смертельные ранения. Специалисты ОмниКорпа, используя новейшие разработки, сохраняют ему жизнь. Алекс возвращается на службу в родной город не только с новыми сверхспособностями, но и с проблемами, с которыми не сталкивался ни один живой человек.',1,48,0,1392480316,23943,'6.7','6.9',1402512239,'','',0,2014,2,1,0,0,1392484592),(315,317,'Гонка / Rush',1,0,'70-е годы XX века. Золотое время «Формулы-1»: обтекаемые формы гоночных машин, брутальные на треке и ранимые в обычной жизни гонщики, сексуальные поклонницы, литры шампанского на финише для победителя… Два непримиримых соперника в истории гонок — обаятельный плейбой-англичанин Джеймс Хант и дисциплинированный перфекционист-австриец Ники Лауда — доводят себя до предела физической и психологической выносливости ради триумфа на трассе. Для них нет легких путей к победе и права на ошибку. Единственный промах гонщикам может стоить карьеры и даже жизни.',2,30,0,1390062631,4067,'8.4','8.5',1402508310,'','',0,2014,2,1,0,0,1390063179),(316,318,'Забойный реванш / Grudge Match',1,1,'Фильм расскажет о двух бывших боксерах, решающих вернуться на ринг ради финального матча, который должен будет уладить все их разногласия и расставить точки над «и».',1,53,0,1390063008,7009,'6.8','7.2',1402492033,'','',0,2013,2,1,0,0,1390063179),(317,319,'Пятая власть / The Fifth Estate',1,1,'В мире, где информация ценится превыше всего, а утечка сведений под грифом «секретно» может вызвать необратимые последствия, сайт WikiLeaks навсегда поменял правила игры. Фильм, основанный на реальных событиях, рассказывает о попытке разоблачить государственную коррупцию и ложь властей, которая превратила интернет-стартап в одну из самых известных и обсуждаемых организаций 21-го века. За первые годы существования WIKILEAKS обнародовал больше тайн, чем самые влиятельные в мире СМИ вместе взятые, раскрывая постыдные секреты государственных служб и финансовые преступления корпораций. Но когда основатели сайта получили доступ к крупнейшему засекреченному архиву США, им предстояло найти для себя ответ на один из важнейших вопросов современности: какова цена тайны в свободном обществе — и какова цена ее разглашения?',2,8,0,1390565247,5595,'5.9','7.0',1402393628,'','',0,2014,2,4,0,0,1390565807),(318,320,'Любовь в большом городе 3',1,1,'В жизни каждого отца, рано или поздно наступает момент, когда жена улетает на заслуженный отдых, а он остается один на один с собственным ребенком. Казалось бы — ничего сложного! Также подумали Игорь, Артем и Сауна, даже не подозревая, какой «водопад» приключений накроет их с головой.\n\nИзмученные «прелестями» отцовства, парни встречают своего старого приятеля Святого Валентина. Снимая стресс за бутылочкой виски, ребята в шутку мечтают о том, чтобы их дети поскорее стали взрослыми.\n\nА на утро, шокированные папаши понимают — их мечта сбылась и теперь они на собственной шкуре поймут, что значит поговорка: Большие дети — большие проблемы…',1,35,0,1390606657,10787,'6.3','6.8',1402437882,'','',0,2014,2,1,0,0,1390893394),(340,342,'Очень плохие парни / Big Bad Wolves',1,0,'Серия жестоких убийств связала в тугой узел судьбы трех людей: отца жертвы, полицейского и главного подозреваемого. Отец жаждет мести. Полицейский действует за рамками закона. А главный подозреваемый — преподаватель теологии — отпущен на свободу по недосмотру полиции.',1,50,0,1390893295,4869,'7.2','7.1',1402458814,'','',0,2013,2,4,0,0,1390893394),(341,343,'Быстрее, чем кролики',1,1,'Трое друзей после бурной вечеринки просыпаются в совершенно незнакомом месте в компании незнакомых людей и пытаются понять, как они здесь оказались, кто все эти люди, и что на самом деле произошло накануне…\n\nЧто делают и о чем говорят мужчины в такой необычной ситуации?',1,39,0,1391176183,6611,'6.7','6.3',1402463774,'','',0,2013,2,1,0,0,1391176511),(342,344,'Я, Франкенштейн / I, Frankenstein',1,1,'Он — монстр. Он — двухсотлетний плод безумной фантазии своего создателя. Он — легенда. Мир, в котором он живет, населен древними горгульями и бессмертными демонами, которые сражаются за обладание человечеством. Величественные соборы скрывают огромные арсеналы, за дверьми научных лабораторий проводятся эксперименты по воскрешению мертвых. Война двух кланов могущественных существ достигает своего пика. И только он, Адам, монстр Франкенштейна, в силах ее остановить.',1,33,0,1391176386,23463,'5.5','5.5',1402514491,'','',0,2013,2,1,0,0,1391176511),(346,348,'Игра Эндера / Ender\'s Game',1,1,'Действие происходит в 2135 году. Человечество пережило два вторжения инопланетной расы «жукеров», лишь чудом уцелев, и готовится к очередному вторжению.\n\nДля поиска пилотов и военачальников, способных принести Земле победу, создаётся военная школа, в которую отправляют самых талантливых детей. Среди этих детей Эндрю (Эндер) Виггин, будущий полководец Международного флота Земли и единственная надежда человечества на спасение.',1,54,0,1391439298,9840,'7.1','6.9',1402484203,'','',0,2013,3,1,0,0,1391439702),(347,349,'Советник / The Counselor',1,0,'Успешный адвокат, стоящий практически на вершине успеха и на пороге собственной свадьбы, из любопытства и, конечно, ради денег соглашается на предложение своего давнего знакомого, имеющего тесные связи с преступным миром, перевезти из Мексики в США партию кокаина стоимостью 20 млн. долл.',1,57,0,1391439572,2629,'5.8','5.7',1402417555,'','',0,2013,2,1,0,0,1391439702),(379,381,'Чемпионы',1,1,'Пять реальных историй больших побед российских спортсменов. И за каждой победой стоят человеческие истории, в которых переплетаются любовь, предательство, дружба, уважение, труд и вера. Вера в себя, вера в победу.',1,40,0,1392398645,5521,'','6.7',1402505633,'','',0,2014,2,1,0,0,1392399015),(400,402,'Захватывающее время /  The Spectacular Now',1,0,'Старшеклассник Саттер Кили, обаятельный и хладнокровный, заводила вечеринок, живет настоящим моментом. Он любит свою работу в магазине мужской одежды, и не строит никаких планов на будущее. Точно прогрессирующий алкоголик, он никогда не расстается со своей флягой с виски. Когда его бросает подруга, Саттер напивается и просыпается на газоне в тени нависшей над ним Эйми Финики. Она другая: «милая девушка», увлекающаяся фантастикой, да к тому же без парня. В то время как Эйми мечтает о будущем, Саттер проживает в блаженном неведении захватывающее время, но каким-то образом, они сближаются.',1,39,0,1392484219,3514,'7.4','7.0',1402489727,'','',0,2013,3,1,0,0,1392484592),(462,464,'Охотники за сокровищами / The Monuments Men',1,1,'Фильм основан на реальных событиях — величайшей охоте на сокровища в истории. Во время Второй мировой войны команда из искусствоведов и хранителей музеев объединяется, чтобы спасти известные произведения искусства, похищенные нацистами, прежде чем те успеют их уничтожить.',1,58,0,1393058044,8594,'5.5','6.4',1402500038,'','',0,2014,6,3,0,0,1393142747),(463,465,'Полицейская история 4 / Jing cha gu shi 2013',1,0,'История начинается с того, что посетители паба оказываются взятыми в заложники. Среди посетителей есть офицер полиции Вэнь Чжун и его непослушная дочь Мяомяо. Человек, удерживающий всех в заложниках — владелец паба, который таким образом пытается добиться освобождения из тюрьмы одного преступника…',1,46,0,1393058433,7646,'6.5','6.4',1402515143,'','',0,2013,2,1,0,0,1393142747),(556,558,'Помпеи / Pompeii',1,1,'История любви раба Майло и благородной Кассии, обрученной с римским сенатором, на фоне извержения Везувия, которое навсегда стерло с лица земли древнеримский город Помпеи…',1,38,0,1393584142,14192,'6.4','6.6',1402511829,'','',0,2014,6,3,0,0,1393584424),(557,559,'Тайна Рагнарока / Gåten Ragnarok',1,0,'Археолог Сигерд Свендсен уже много лет одержим историей судна викингов Осберг. Единственная надпись, найденная на этом корабле написана на языке рун и гласит: «человек знает мало». Сигерд уверен, что судно Осберг скрывает ответ на тайну о Рагнароке — конце дней в норвежской мифологии. Когда его друг Аллан находит подобные руны на камне с севера Норвегии, Сигерд убеждается, что руны — это карта сокровищ. Вместе они отправляются в экспедицию, которая заводит их в «нейтральную зону» между Норвегией и Россией, которая не населена уже многие десятилетия. Здесь Сигерд находит истинное значение рун, которые хранят ужасающую тайну.',1,41,0,1393584334,6296,'6.5','5.3',1402500002,'','',0,2013,1,1,0,0,1393584424),(558,560,'Несносный дед / Jackass Presents: Bad Grandpa',1,1,'86-летний старикан по имени Ирвинг Зисман путешествует по Америке с необычным компаньоном — восьмилетним «внуком» Билли.\n\nПо дороге заводной дедушка знакомит впечатлительного Билли с людьми, местами и ситуациями, которые вряд ли укладываются в рамки привычных представлений о воспитании. Парочка столкнется со стриптизерами, разъяренными участниками помпезного детского конкурса красоты и их не менее злыми мамашами, скорбящими посетителями панихиды, завсегдатаями бара для байкеров и другими ничего не подозревающими гражданами США.',1,44,0,1393668444,4172,'6.7','6.4',1402514474,'','',0,2013,2,1,0,0,1393669407),(559,561,'Воровка книг / The Book Thief',1,0,'Германия, начало 1939 года, канун Второй мировой войны. Смерть готовится начать свою жатву. Девятилетняя Лизель переезжает в Мюнхен к своим приемным родителям и с их помощью учится читать. С каждым днем чтение становится ее жизненной потребностью, и Лизель начинает воровать книги — единственную отраду ее жизни. Все, что она узнает из них, помогает ей понять события, происходящие вокруг нее — гонение на евреев, антифашистское движение, унижения и голод. Все это, в конце концов, сложится в ее собственную историю, историю ее жизни.',2,11,0,1393668594,1695,'7.7','7.9',1402515186,'','',0,2013,2,1,0,0,1393669407),(560,562,'Август / August: Osage County',1,0,'В городе Талса, штат Оклахома, в отчий дом съезжаются члены большой семьи Уэстонов. Случилось несчастье и три дочери Барбара, Карен и Иви, их мать Виолетта, тетя Метти Фей, а также их мужья, дети и ухажеры собираются под одной крышей, пьют виски и выясняют отношения, обвиняя друг друга в предательствах, подавленных чувствах и изломанных судьбах. У каждого есть свой скелет в шкафу и все тайное, что обычно скрывается за фасадом благополучного дома, становится явным.',2,1,0,1394010627,662,'7.4','8.0',1402435416,'','',0,2013,2,1,0,0,1394010757),(569,571,'Лекарь: Ученик Авиценны / The Physician',1,0,'Англия, XI век. Мать десятилетнего Роба Коула умирает в страшных мучениях: никто не знает ни природы её болезни, ни лекарства против неё. Маленький Роб, потрясенный до глубины души, во что бы то ни стало стремится разгадать эту тайну.\n\nЕму суждено пройти долгий путь, от Англии до Персии, его учителями становятся сначала обыкновенный шарлатан Барбер, а потом — великий лекарь Авиценна. Мудрый учитель видит в Робе необыкновенный талант к медицине, но советует ему не спешить делать вещи, которые не соответствуют веку. Но Роб ни перед чем не останавливается в своем желании научиться спасать людей от смерти, и над его собственной жизнью нависает угроза, ведь он дважды пошел против предрассудков: использовал для научных исследований тело человека и полюбил женщину, отданную в жены другому.',0,0,0,1394293958,3944,'7.3','7.8',1402491400,'','',0,2013,2,1,0,0,1394294058),(586,588,'Мистериум. Начало / Kvinden i buret',1,0,'Экранизация приключений детективов Карла Мерке и Асада, работающих в Департаменте Q, занимающемся «глухарями». Взявшись за дело пятилетней давности об исчезновении женщины по имени Мерет они внезапно выходят на след маньяка-психопата, но преследуя его по всей стране, все равно на шаг отстают',1,36,0,1394458927,1735,'7.1','7.2',1402477293,'','',0,2013,2,1,0,0,1394458965),(590,592,'Отец-молодец / Delivery Man',1,1,'Жизнь бруклинского работяги Дэвида Возняка не похожа на праздник: у него кризис среднего возраста, он должен денег подпольному ростовщику, девушка собирается его бросить, а родной отец грозит увольнением с работы. А в довершение всех бед к нему приходит адвокат с известием о том, что в результате ошибки, которую двадцать лет назад совершили в банке спермы, который Дэвид посещал в студенческие годы, он является биологическим отцом 533 детей. И 142 из них обратились в суд с требованием раскрыть имя своего родителя. Вначале Дэвид не знает, что делать в такой ситуации, но постепенно любопытство перевешивает, и он решает — инкогнито — узнать поближе хотя бы некоторых из своих нежданных потомков…',1,46,0,1394617329,3736,'6.4','6.8',1402487918,'','',0,2014,2,1,0,0,1394732342),(591,593,'300 спартанцев: Расцвет империи / 300: Rise of an Empire',1,1,'После победы над царем Леонидом персидская армия во главе с Ксерксом движется на север. На её пути оказывается флот Афин под руководством адмирала Фемистокла. Силы противников не равны, и Фемистокл вынужден вступить в союз с заклятым врагом афинского государства Спартой. Только объединившись у враждующих полисов-государств есть шанс что-то противопоставить могущественному Ксерксу.',1,42,0,1394617496,24865,'7.2','7.2',1402513235,'','',0,2014,6,3,0,0,1394732342),(646,648,'Уцелевший / Lone Survivor',1,1,'Афганистан, 2005 год. Команда американских спецназовцев получает задание обезвредить известного лидера талибов Ахмада Шаха. Попав в ловушку, солдаты принимают неравный кровопролитный бой, и все они погибают героями. Все, кроме одного. Для уцелевшего Маркуса Латтрела бой только начинается: он любой ценой должен выжить и пробраться к «своим». Когда почти всё потеряно, ему решается помочь Гулаб — мирный человек, ненавидящий войну.',2,1,0,1394876886,10063,'7.8','7.3',1402512985,'','',0,2013,2,1,0,0,1394876942),(678,680,'Вий',1,1,'',2,8,0,1395000630,15667,'6.0','6.0',1402499938,'','',0,2013,2,1,0,0,1395000692),(680,682,'Need for Speed: Жажда скорости / Need for Speed',1,1,'История Тоби Маршалла, гениального автомеханика, чьей единственной отдушиной является участие в подпольных гонках. Чтобы сохранить семейную мастерскую, Тоби вынужден взять в партнеры богатого и заносчивого бывшего гонщика NASCAR Дино Брюстера. Когда дела Тоби наконец-то начинают идти в гору, Дино подставляет партнера, и Тоби обвиняют в преступлении, которого он не совершал. Спустя два года Тоби выходит из тюрьмы с мыслью о мести. Чтобы достичь своей цели, ему придется совершить невозможное и доказать, что даже в мире броских суперкаров самый невзрачный гонщик может финишировать первым.',2,10,0,1395134478,34820,'7.3','7.3',1402514002,'','',0,2014,6,3,0,0,1395134611),(743,745,'Феи: Загадка пиратского острова / The Pirate Fairy',1,1,'История о Зарине, смышленой и амбициозной фее, собирающей пыльцу растений. Все начинается с того, что она похищает волшебную пыльцу фей…',1,18,0,1396075077,7807,'7.0','6.8',1402503860,'','',0,2014,2,1,0,0,1396075202),(750,752,'Дубровский',1,0,'Владимир Дубровский — успешный столичный юрист и завсегдатай модных клубов, Маша Троекурова — выпускница английского колледжа и нежная дочь… Хозяева собственных судеб, они едва ли похожи на героев Пушкина. Но внезапная ссора их отцов решительно меняет жизнь Владимира и Маши — они погружаются в реальность, где действуют совсем другие законы…',2,3,0,1396193080,1210,'6.6','6.0',1402480008,'','',0,2014,1,1,0,0,1396193659),(1040,1042,'Джек Райан: Теория хаоса / Jack Ryan: Shadow Recruit',1,0,'Рядовой аналитик ЦРУ Джек Райан приезжает в Москву, чтобы решить простую задачу: ему нужно проверить операции компании, принадлежащей миллиардеру Виктору Черевину. Но все усложняется, когда Райана пытаются убить. Теперь он вынужден защищаться с оружием в руках, вспоминая армейские навыки и неожиданно для себя оказываясь в роли настоящего спецагента. На помощь Джеку приходят маститый офицер спецслужб Харпер и внезапно оказавшаяся в Москве супруга Кэти. Но облегчит ли это миссию, которую теперь предстоит выполнить Райану, — предотвратить международный заговор, грозящий погрузить весь мир в хаос?',1,45,0,1399484691,4643,'6.5','5.5',1402513367,'','',0,2014,2,1,0,0,1399485141),(720,722,'Перекрестный огонь / Bad Country',1,0,'Фильм снят по реальным событиям. Расследование детектива Бада Картера приводит к аресту Джесси Вейланда, наемного убийцы из преступного синдиката. Вейланд осознает, что попав в тюрьму, он потеряет свою семью, и решает довериться Картеру, став его информатором.',1,40,0,1395498630,6397,'5.7','5.7',1402505028,'','',0,2014,2,1,0,0,1395498755),(821,823,'Ной / Noah',1,1,'История отца, воина и спасителя Человечества и всего живого на Земле.',2,18,0,1396627094,14267,'6.8','7.3',1402502624,'','',0,2014,6,3,0,0,1396627385),(823,825,'Первый мститель: Другая война / Captain America: The Winter Soldier',1,1,'После беспрецедентных событий, впервые собравших вместе команду Мстителей, Стив Роджерс, известный также как Капитан Америка, оседает в Вашингтоне и пытается приспособиться к жизни в современном мире. Но покой этому герою только снится — пытаясь помочь коллеге из агентства Щ. И. Т, Стив оказывается в центре событий, грозящих катастрофой мирового масштаба. Для того, чтобы разоблачить злодейский заговор, Капитан Америка объединяется с Черной вдовой. К ним также присоединяется новый соратник, известный как Сокол, однако никто из них даже не подозревает, на что способен новый враг.',2,16,0,1396627327,28798,'7.9','8.4',1402511520,'','',0,2014,6,3,0,0,1396627385),(888,890,'Дивергент / Divergent',1,1,'Действие развивается на Земле в будущем, в деспотичном Чикаго. Все подростки, достигшие 16 лет, обязаны выбрать одну из пяти фракций и присоединиться к ней на всю оставшуюся жизнь. Каждая фракция представляет определенное качество: Искренность, Отречение, Бесстрашие, Дружелюбие и Эрудиция.',2,28,0,1396944098,13117,'7.6','7.0',1402511257,'','',0,2014,6,3,0,0,1396944231),(962,964,'Этот неловкий момент / That Awkward Moment',1,0,'Джейсон, Дэниел и Майкл — типичные обитатели Манхеттена, красивые остроумные парни. После того, как одного из них бросает подружка, они клянутся больше никогда не заводить с девушками серьезных отношений. Но очень скоро, после кучи «неловких моментов», они встречают настоящую любовь. И как теперь быть с дружеской сделкой?',1,34,0,1397375607,5645,'6.2','5.8',1402507475,'','',0,2014,2,1,0,0,1397376080),(963,965,'Владение 18',1,0,'Сиреневые Холмы, Владение 18 - адрес обычной многоэтажки на окраине города. Скоро здесь будет новый цветущий микрорайон, но пока вокруг царит девственное запустение. Сейчас цены на квартиры в этом доме так заманчиво низки... И продают их, оказывается, только по специальной благотворительной программе инвесторов! Когда ещё небогатым молодожёнам Свете и Максиму представится такой удивительный шанс переехать из крохотной коммуналки в собственную просторную квартиру?..',1,30,0,1397375963,5766,'6.8','4.6',1402508318,'','',0,2013,2,1,0,0,1397376080),(966,968,'13 грехов / 13 Sins',1,1,'Эллиот Бриндл — умный кроткий сотрудник службы социального обеспечения, тонущий в долгах. Но все меняется, когда раздается телефонный звонок. На том конце провода ему сообщают, что он становится участником тв-шоу, условия простые — выполнить 13 заданий, какими бы странными они не были; приз — деньги, которые копятся с каждым выполненным заданием. Отказ от выполнения или провал задания ведет к обнулению банка.\n\nДеньги можно забрать только выполнив все 13 заданий ведущего. Эллиот следует первым инструкциям и с легкостью съедает пойманную муху. На счету Бриндла появляются первые легкие деньги. Эллиот хочет, но не может прекратить игру, чтобы не потерять «заработанное», хотя задачи становятся более изощренными и опасными, а точка невозврата вот-вот будет пройдена.',1,32,0,1398007743,5497,'6.3','6.1',1402502837,'','',0,2014,2,1,0,0,1398008374),(967,969,'Саботаж / Sabotage',1,0,'История начинается с операции элитного подразделения из управления по борьбе с наркотиками, нагрянувшего на явочную квартиру наркокартеля. Команда решает скрыть от начальства, что в результате налёта они обогатились на миллионы долларов, но вскоре хранить тайну становится всё сложнее: кто-то по одному убирает всех участвовавших в операции.',1,49,0,1398008075,3273,'5.7','6.5',1401619722,'','',0,2014,6,3,0,0,1398008374),(968,970,'Геракл: Начало легенды / The Legend of Hercules',1,0,'1200 г. до н. э. Древняя Греция. Прекрасная царица Алкмена попала под чары грозного бога Олимпа — Зевса и родила ему сына Геракла. При рождении ему было предсказано стать величайшим воином, который будет властвовать над народами и принесет мир и процветание своей стране. Но пока Геракл ничего не знает о своем предназначении. Он вырос прекрасным и сильным юношей. Он мечтает о любви принцессы Крита, Гебы, которая обещана в жены его брату. Когда Геракл узнает о своей великой миссии, он должен выбрать: сбежать со своей любовью или исполнить свое предназначение.',1,39,0,1398008305,11533,'4.2','4.6',1402503606,'','',0,2014,2,1,0,0,1398008374),(978,980,'Новый Человек-паук: Высокое напряжение / The Amazing Spider-Man 2',1,1,'Питер Паркер под маской Человека-паука по-прежнему спасает мир от злодеев и преступников, а свободное время проводит со своей возлюбленной Гвен, но школьная пора близится к концу, и впереди героев ждет взрослая жизнь. Питер помнит о том, что дал отцу Гвен слово навсегда уйти из жизни девушки, тем самым больше не подвергая ее опасности. Однако сдержать это обещание не так просто. Судьба готовит Питеру сюрпризы: на его пути появится новый противник — Электро, а также ему будет суждено вновь встретиться с давним приятелем Гарри Озборном и узнать много нового о прошлом своей семьи.',2,22,0,1398377265,38801,'7.5','8.0',1402513400,'','',0,2014,6,3,0,0,1398540115),(979,981,'Рио 2 / Rio 2',1,1,'Голубчик, Жемчужинка и их трое детей живут счастливой жизнью в волшебном городе Рио-де-Жанейро. Когда Жемчужинка решает, что их детям нужно научиться жить как настоящим птицам, она настаивает на авантюрной поездке в дебри реки Амазонки. Там, пытаясь вписаться в новое окружение, Голубчик начинает беспокоиться, что может потерять Жемчужинку и детей, идущих на зов дикой природы.',1,44,0,1398539767,10533,'6.8','7.0',1402514582,'','',0,2014,5,3,0,0,1398540115),(980,982,'Стартап',1,0,'Как в России честно заработать своим умом? Как добиться успеха и утвердить свое имя в мире бизнеса? Чем жертвует и что приобретает человек, который много лет стремится к своей цели? История создания с нуля крупного российского поискового портала. 20 лет риска, трудов, надежды, 20 лет дружбы…',1,32,0,1398540027,749,'5.8','5.2',1402448942,'','',0,2014,2,1,0,0,1398540115),(1068,1070,'12 лет рабства / 12 Years a Slave',1,1,'Соломон Нортап был женатым и образованным мужчиной, который жил и работал в Нью-Йорке, когда два человека однажды предложили ему привлекательную работу в Вашингтоне. По прибытии он был похищен, стал рабом и влачил жалкую жизнь, переходя от одного хозяина к другому.',2,13,0,1400314949,1922,'8.3','7.8',1402513828,'','',0,2014,2,1,0,0,1400315058),(1107,1109,'Годзилла / Godzilla',1,1,'Человечество случайно разбудило гигантское древнее существо, что повлекло за собой ужасающие последствия…',2,3,0,1400503673,14698,'7.6','6.9',1402514241,'','',0,2014,6,3,0,0,1400504589),(992,994,'С 8 марта, мужчины!',1,0,'Анна Беркутова — блондинка в броне из мини-юбки и глубокого декольте. Ее оружие — красота, ум и абсолютная уверенность в том, что она знает мужчин. Она ведет важный проект в Сколково и собирается замуж за богатого иностранца. Но в день ее рождения, 8 марта, ее четкая, как финансовый отчет, судьба меняется: Аню бросает жених, ее проект крадут из Сколково, а сама она начинает слышать мысли мужчин. Эта способность сначала доводит ее до отчаяния, а затем открывает широкие возможности…',1,35,0,1398775006,4503,'','4.7',1402515772,'','',0,2014,2,1,0,0,1398775105),(1141,1143,'Люди Икс: Дни минувшего будущего / X-Men: Days of Future Past',1,1,'В будущем — лагерь для интернированных, где живут мутанты, лишившиеся свободы. В настоящем — непрекращающееся противостояние с Братством злых мутантов во главе с Магнето. В прошлом — возможность предотвратить господство Стражей, а значит, грядущую для мутантов изоляцию. Благодаря своим способностям путешествовать во времени, Китти Прайд, живущая в будущем, предупреждает нынешних мутантов о том, что их ждет. Но этого недостаточно, ведь из грядущего в настоящее явились и силы зла.',2,11,0,1401094584,14370,'8.8','8.3',1402515870,'','',0,2014,6,3,0,0,1401095033),(1041,1043,'Охотники за сокровищами / The Monuments Men',1,0,'Фильм основан на реальных событиях — величайшей охоте на сокровища в истории. Во время Второй мировой войны команда из искусствоведов и хранителей музеев объединяется, чтобы спасти известные произведения искусства, похищенные нацистами, прежде чем те успеют их уничтожить.',1,58,0,1399484933,1682,'6.3','5.5',1402495968,'','',0,2014,3,1,0,0,1399485141),(1060,1062,'Авантюристы',1,0,'Катя и Андрей, успешный молодой банкир, прилетают на Мальту на отдых. В дайвинг-центре они случайно встречают Макса — профессионального дайвера, тайком занимающегося черной археологией, и, по совместительству, бывшего возлюбленного Кати.\n\nВо время одного из погружений Катя находит фрагмент спасательного жилета с номером немецкой подлодки времен Второй мировой. Девушка выясняет, что в 1942 году у мальтийского ордена рыцарей-госпитальеров была похищена коллекция уникальных древнеегипетских реликвий, которая должна была быть доставлена в Германию именно на подлодке. Однако ценный груз туда в итоге не прибыл.\n\nРассудив, что подводная лодка с сокровищами, скорее всего, лежит на дне у берегов Мальты, троица начинает ее поиски, ввязываясь в череду опасных авантюр, в том числе и подводных. А отношения между искателями приключений все больше напоминают любовный треугольник…',1,30,0,1399965440,1850,'','5.0',1402497781,'','',0,2014,1,1,0,0,1399965661),(1142,1144,'Блондинка в эфире Walk of Shame',1,1,'Мечта репортерши стать ведущей программы новостей может быть разрушена. После ночи кутежа она оказывается в дальнем районе Лос-Анджелеса без телефона, автомобиля, паспорта и денег — и у нее остается только 8 часов, чтобы добраться до самого важного собеседования ее жизни.',1,35,0,1401094967,2662,'6.1','6.6',1402513357,'','',0,2014,2,1,0,0,1401095033),(1143,1145,'',0,0,'',0,0,0,1401161045,1,'','',1401161045,'','',0,0,0,0,0,0,0),(1144,1146,'',0,0,'',0,0,0,1401161725,1,'','',1401161725,'','',0,0,0,0,0,0,0),(1145,1147,'',0,0,'',0,0,0,1401371376,1,'','',1401371376,'','',0,0,0,0,0,0,0),(1146,1148,'',0,0,'',0,0,0,1401537566,1,'',''